(37, '', '', 'registration_successful__we_have_sent_you_an_email__please_check_your_inbox_spam_to_verify_your_account.', 'Registration successful! We have sent you an email, Please check your inbox/spam to verify your account.', 'تم التسجيل بنجاح لقد أرسلنا لك رسالة بريد إلكتروني ، يرجى التحقق من البريد الوارد / البريد العشوائي للتحقق من حسابك.', 'Registratie gelukt! We hebben je een e-mail gestuurd. Controleer je inbox / spam om je account te verifiëren.', 'Inscription réussi! Nous vous avons envoyé un courrier électronique. Veuillez vérifier votre boîte de réception / spam pour vérifier votre compte.', 'Registrierung erfolgreich! Wir haben Ihnen eine E-Mail gesendet. Bitte überprüfen Sie Ihren Posteingang / Spam, um Ihr Konto zu bestätigen.', 'Регистрация прошла успешно! Мы отправили вам письмо, пожалуйста, проверьте свой почтовый ящик / спам, чтобы подтвердить свой аккаунт.', '¡Registro exitoso! Le hemos enviado un correo electrónico. Verifique su bandeja de entrada / correo no deseado para verificar su cuenta.', 'Kayıt başarılı! Size bir e-posta gönderdik, hesabınızı doğrulamak için lütfen gelen kutunuzu / spam’nizi kontrol edin.', 'पंजीकरण सफल! हमने आपको एक ईमेल भेजा है, कृपया अपना खाता सत्यापित करने के लिए अपना इनबॉक्स/स्पैम जांचें।', '注册成功！我们已向您发送了一封电子邮件，请检查您的收件箱/垃圾邮件以验证您的帐户。', 'رجسٹریشن کامیاب! ہم نے آپ کو ایک ای میل بھیجا ہے، براہ کرم اپنے اکاؤنٹ کی تصدیق کے لیے اپنا ان باکس/سپیم چیک کریں۔', 'Registrasi berhasil! Kami telah mengirimkan email kepada Anda, Silakan periksa kotak masuk/spam Anda untuk memverifikasi akun Anda.', 'Registracija uspješna! Poslali smo vam e-poruku. Provjerite svoju pristiglu poštu/neželjenu poštu kako biste potvrdili svoj račun.', 'ההרשמה בוצעה בהצלחה! שלחנו לך אימייל, אנא בדוק את תיבת הדואר הנכנס/ספאם שלך כדי לאמת את חשבונך.', 'অস্ত্রোপচার! আমরা আপনাকে একটি ইমেল পাঠিয়েছি, আপনার অ্যাকাউন্ট যাচাই করতে আপনার ইনবক্স/স্প্যাম চেক করুন।', '登録に成功！メールを送信しました。受信ボックス/スパムをチェックして、アカウントを確認してください。', 'ثبتنام موفقیتآمیز! ما یک ایمیل برای شما ارسال کرده ایم، لطفا صندوق ورودی/هرزنامه خود را بررسی کنید تا حساب خود را تأیید کنید.', 'Registrering lyckad! Vi har skickat ett e-postmeddelande till dig. Kontrollera din inkorg/spam för att verifiera ditt konto.', 'Đăng ký thành công! Chúng tôi đã gửi cho bạn một email, Vui lòng kiểm tra hộp thư đến / thư rác để xác minh tài khoản của bạn.', 'Registreringen lykkedes! Vi har sendt dig en e-mail. Tjek venligst din indbakke/spam for at bekræfte din konto.', 'Maayos ang pagrehistro! Nagpadala kami sa iyo ng isang email, Mangyaring suriin ang iyong inbox/spam upang i-verify ang iyong account.', '등록 성공! 이메일을 보냈습니다. 받은 편지함/스팸을 확인하여 계정을 확인하십시오.'),
