(82, '', '', 'are_you_sure_you_want_to_delete_your_account__all_content_including_published_songs__will_be_permanetly_removed_', 'Are you sure you want to delete your account? All content including published songs, will be permanetly removed!', 'هل انت متأكد انك تريد حذف حسابك؟ ستتم إزالة جميع المحتويات بما في ذلك الأغاني المنشورة نهائيًا!', 'Weet je zeker dat je je account wilt verwijderen? Alle inhoud, inclusief gepubliceerde nummers, wordt permanent verwijderd!', 'Êtes-vous sûr de vouloir supprimer votre compte? Tout le contenu, y compris les chansons publiées, sera définitivement supprimé!', 'Möchten Sie Ihr Konto wirklich löschen? Alle Inhalte einschließlich der veröffentlichten Songs werden dauerhaft entfernt!', 'Вы уверены, что хотите удалить свой аккаунт? Весь контент, включая опубликованные песни, будет окончательно удален!', '¿Estás seguro de que quieres eliminar tu cuenta? Todo el contenido, incluidas las canciones publicadas, se eliminará permanentemente!', 'Hesabınızı silmek istediğinizden emin misiniz? Yayınlanan şarkılar dahil tüm içerikler kalıcı olarak kaldırılacak!', 'क्या आप इस खाते को हटाने के लिए सुनिश्चित हैं? प्रकाशित गीतों सहित सभी सामग्री को स्थायी रूप से हटा दिया जाएगा!', '您确定要删除您的帐户吗？所有内容，包括已发布的歌曲，将被永久删除！', 'کیا آپ واقعی اپنا اکاؤنٹ حذف کرنا چاہتے ہیں؟ شائع شدہ گانوں سمیت تمام مواد کو مستقل طور پر ہٹا دیا جائے گا!', 'Apakah Anda yakin ingin menghapus akun Anda? Semua konten termasuk lagu yang diterbitkan, akan dihapus secara permanen!', 'Jeste li sigurni da želite izbrisati svoj račun? Sav sadržaj uključujući objavljene pjesme bit će trajno uklonjen!', 'האם אתה בטוח שברצונך למחוק את חשבונך? כל התוכן כולל שירים שפורסמו, יוסר לצמיתות!', 'আপনি আপনার অ্যাকাউন্ট মুছে ফেলতে চান আপনি কি নিশ্চিত? প্রকাশিত গান সহ সমস্ত বিষয়বস্তু স্থায়ীভাবে মুছে ফেলা হবে!', 'アカウントを削除してもよろしいですか？公開された曲を含むすべてのコンテンツは永久に削除されます!', 'آیا مطمئن هستید که می خواهید اکانت خود را حذف کنید؟ تمام مطالب از جمله آهنگ های منتشر شده، برای همیشه حذف خواهند شد!', 'Är du säker på att du vill ta bort ditt konto? Allt innehåll inklusive publicerade låtar kommer att tas bort permanent!', 'Bạn có chắc rằng bạn muốn xóa tài khoản của bạn? Tất cả nội dung bao gồm các bài hát đã xuất bản, sẽ bị xóa vĩnh viễn!', 'Er du sikker på, at du vil slette din konto? Alt indhold, inklusive offentliggjorte sange, vil blive permanent fjernet!', 'Sigurado ka bang gusto mong tanggalin ang iyong account? Ang lahat ng nilalaman kabilang ang mga nai-publish na kanta, ay permanenteng aalisin!', '계정을 삭제하시겠습니까? 공개된 노래를 포함한 모든 콘텐츠는 영구적으로 제거됩니다!'),
