(135, '', '', 'audio_file_not_found__please_refresh_the_page_and_try_again.', 'Audio file not found, please refresh the page and try again.', 'لم يتم العثور على الملف الصوتي ، يرجى تحديث الصفحة والمحاولة مرة أخرى.', 'Audiobestand niet gevonden, vernieuw de pagina en probeer het opnieuw.', 'Fichier audio non trouvé, veuillez actualiser la page et réessayer.', 'Audiodatei nicht gefunden. Aktualisieren Sie die Seite und versuchen Sie es erneut.', 'Аудио файл не найден, обновите страницу и попробуйте снова.', 'No se encontró el archivo de audio, por favor actualice la página y vuelva a intentarlo.', 'Ses dosyası bulunamadı, lütfen sayfayı yenileyin ve tekrar deneyin.', 'ऑडियो फ़ाइल नहीं मिली, कृपया पृष्ठ को रीफ़्रेश करें और पुनः प्रयास करें।', '找不到音频文件，请刷新页面重试。', 'آڈیو فائل نہیں ملی، براہ کرم صفحہ ریفریش کریں اور دوبارہ کوشش کریں۔', 'File audio tidak ditemukan, harap segarkan halaman dan coba lagi.', 'Audio datoteka nije pronađena, osvježite stranicu i pokušajte ponovno.', 'קובץ השמע לא נמצא, אנא רענן את הדף ונסה שוב.', 'অডিও ফাইল পাওয়া যায়নি, অনুগ্রহ করে পৃষ্ঠা রিফ্রেশ করুন এবং আবার চেষ্টা করুন।', 'オーディオ ファイルが見つかりません。ページを更新して、もう一度お試しください。', 'فایل صوتی پیدا نشد، لطفاً صفحه را بازخوانی کنید و دوباره امتحان کنید.', 'Ljudfilen hittades inte. Uppdatera sidan och försök igen.', 'Không tìm thấy tệp âm thanh, vui lòng làm mới trang và thử lại.', 'Lydfilen blev ikke fundet. Opdater siden og prøv igen.', 'Hindi nahanap ang audio file, paki-refresh ang page at subukang muli.', '오디오 파일을 찾을 수 없습니다. 페이지를 새로고침하고 다시 시도하십시오.'),
(136, '', '', 'something_went_wrong_please_try_again_later_', 'Something went wrong Please try again later!', 'هناك شئ خاطئ، يرجى المحاولة فى وقت لاحق!', 'Er is iets misgegaan Probeer het later opnieuw!', 'Quelque chose c\'est mal passé. Merci d\'essayer plus tard!', 'Etwas ist schief gelaufen. Bitte versuchen Sie es später noch einmal!', 'Что-то пошло не так. Пожалуйста, повторите попытку позже!', 'Algo salió mal Por favor, intente de nuevo más tarde!', 'Bir şeyler yanlış oldu. Lütfen sonra tekrar deneyiniz!', 'कुछ गलत हो गया है। कृपया बाद में दोबारा प्रयास करें!', '发生错误。请稍后再试！', 'کچھ غلط ہو گیا. براہ کرم کچھ دیر بعد کوشش کریں!', 'Ada yang tidak beres Harap coba lagi nanti!', 'Nešto je pošlo po zlu. Molimo pokušajte ponovo kasnije!', 'משהו השתבש אנא נסה שוב מאוחר יותר!', 'কিছু ভুল হয়েছে। পরে আবার চেষ্টা করুন!', '何かが間違っています。後でもう一度試してください！', 'مشکلی رخ داده است. لطفا بعدا دوباره امتحان کنید!', 'Försök igen senare!', 'Đã xảy ra sự cố Vui lòng thử lại sau!', 'Noget gik galt. Prøv igen senere!', 'Nagkaproblema Pakisubukang muli mamaya!', '문제가 발생했습니다 나중에 다시 시도하십시오!'),
(138, '', '', 'please_wait__your_track_is_being_coverted_to_mp3_audio_file._this_might_take_a_few_minutes.', 'Please wait, your track is being coverted to mp3 audio file. This might take a few minutes.', 'الرجاء الانتظار ، يتم إخفاء المسار الخاص بك إلى ملف صوتي MP3. وهذا قد يستغرق بضع دقائق.', 'Een ogenblik geduld, je nummer wordt omspoeld naar mp3-audiobestand. Dit kan een paar minuten duren.', 'Veuillez patienter, votre piste est convertie en fichier audio mp3. Ceci pourrait prendre quelques minutes.', 'Bitte warten Sie, Ihr Track wird in eine MP3-Audiodatei umgewandelt. Dies könnte ein paar Minuten dauern.', 'Пожалуйста, подождите, ваш трек записывается в mp3-файл. Это может занять несколько минут.', 'Por favor espere, su pista está siendo cubierta a un archivo de audio mp3. Esto puede tardar unos minutos.', 'Lütfen bekleyin, parçanız mp3 ses dosyasına dönüştürülüyor. Bu, birkaç dakika sürebilir.', 'कृपया प्रतीक्षा करें, आपके ट्रैक को एमपी3 ऑडियो फ़ाइल में कवर किया जा रहा है। इसमें कुछ मिनट लग सकते हैं।', '请稍候，您的曲目正在转换为 mp3 音频文件。这可能需要几分钟。', 'براہ کرم انتظار کریں، آپ کا ٹریک mp3 آڈیو فائل میں کور کیا جا رہا ہے۔ اس میں کچھ منٹ لگ سکتے ہیں۔', 'Harap tunggu, trek Anda sedang disamarkan ke file audio mp3. Ini mungkin memakan waktu beberapa menit.', 'Molimo pričekajte, vaša pjesma se pretvara u mp3 audio datoteku. Ovo može potrajati nekoliko minuta.', 'אנא המתן, הרצועה שלך מוסתרת לקובץ שמע mp3. זה עשוי לקחת כמה דקות.', 'অনুগ্রহ করে অপেক্ষা করুন, আপনার ট্র্যাকটি mp3 অডিও ফাইলে কভার করা হচ্ছে৷ এতে কয়েক মিনিট সময় লাগতে পারে।', 'お待ちください。トラックを mp3 オーディオ ファイルに変換しています。これには数分かかる場合があります。', 'لطفا صبر کنید، آهنگ شما در حال پوشاندن فایل صوتی mp3 است. این ممکن است چند دقیقه طول بکشد.', 'Vänta, ditt spår döljs till mp3-ljudfil. Detta kan ta några minuter.', 'Vui lòng đợi, bản nhạc của bạn đang được chuyển thành tệp âm thanh mp3. Điều này có lẽ tốn một vài phút.', 'Vent venligst, dit nummer bliver skjult til mp3-lydfil. Dette kan tage et par minutter.', 'Mangyaring maghintay, ang iyong track ay tinatakpan sa mp3 audio file. Maaaring tumagal ito ng ilang minuto.', '잠시만 기다려 주십시오. 트랙이 mp3 오디오 파일로 변환되고 있습니다. 몇 분 정도 걸릴 수 있습니다.'),
(139, '', '', 'invalid_file_format__only_mp3_is_allowed', 'Invalid file format, only mp3 is allowed', 'تنسيق ملف غير صالح ، يُسمح بتنسيق mp3 فقط', 'Ongeldige bestandsindeling, alleen mp3 is toegestaan', 'Format de fichier invalide, seul le format mp3 est autorisé', 'Ungültiges Dateiformat, nur MP3 ist zulässig', 'Неверный формат файла, разрешен только mp3', 'Formato de archivo inválido, solo se permite mp3', 'Geçersiz dosya formatı, sadece mp3 izin verilir', 'अमान्य फ़ाइल स्वरूप, केवल mp3 की अनुमति है', '文件格式无效，只允许 mp3', 'غلط فائل فارمیٹ، صرف mp3 کی اجازت ہے۔', 'Format file tidak valid, hanya mp3 yang diizinkan', 'Nevažeći format datoteke, dopušten je samo mp3', 'פורמט קובץ לא חוקי, רק mp3 מותר', 'অবৈধ ফাইল বিন্যাস, শুধুমাত্র mp3 অনুমোদিত', 'ファイル形式が無効です。mp3 のみ使用できます', 'فرمت فایل نامعتبر است، فقط mp3 مجاز است', 'Ogiltigt filformat, endast mp3 är tillåtet', 'Định dạng tệp không hợp lệ, chỉ cho phép mp3', 'Ugyldigt filformat, kun mp3 er tilladt', 'Di-wastong format ng file, mp3 lang ang pinapayagan', '잘못된 파일 형식입니다. mp3만 허용됩니다.'),
(140, '', '', 'invalid_file_format__only_jpg__jpeg__png_are_allowed', 'Invalid file format, only jpg, jpeg, png are allowed', 'تنسيق ملف غير صالح ، يُسمح فقط بتنسيق jpg و jpeg و png', 'Ongeldige bestandsindeling, alleen jpg, jpeg, png zijn toegestaan', 'Format de fichier invalide, seuls les formats jpg, jpeg, png sont autorisés', 'Ungültiges Dateiformat, nur jpg, jpeg, png sind zulässig', 'Неверный формат файла, разрешены только jpg, jpeg, png', 'Formato de archivo no válido, solo se permiten jpg, jpeg, png', 'Geçersiz dosya formatı, sadece jpg, jpeg, png izin verilir', 'अमान्य फ़ाइल स्वरूप, केवल jpg, jpeg, png की अनुमति है', '文件格式无效，只允许 jpg、jpeg、png', 'غلط فائل فارمیٹ، صرف jpg، jpeg، png کی اجازت ہے۔', 'Format file tidak valid, hanya jpg, jpeg, png yang diizinkan', 'Nevažeći format datoteke, dopušteni su samo jpg, jpeg, png', 'פורמט קובץ לא חוקי, רק jpg, jpeg, png מותרים', 'অবৈধ ফাইল বিন্যাস, শুধুমাত্র jpg, jpeg, png অনুমোদিত', '無効なファイル形式です。jpg、jpeg、png のみ使用できます', 'فرمت فایل نامعتبر، فقط jpg، jpeg، png مجاز است', 'Ogiltigt filformat, endast jpg, jpeg, png är tillåtna', 'Định dạng tệp không hợp lệ, chỉ cho phép jpg, jpeg, png', 'Ugyldigt filformat, kun jpg, jpeg, png er tilladt', 'Di-wastong format ng file, jpg, jpeg, png lang ang pinapayagan', '잘못된 파일 형식입니다. jpg, jpeg, png만 허용됩니다.'),
(141, '', '', 'error_found_while_uploading_your_image__please_try_again_later.', 'Error found while uploading your image, please try again later.', 'تم العثور على خطأ أثناء تحميل صورتك ، يرجى إعادة المحاولة لاحقًا.', 'Fout gevonden tijdens het uploaden van uw afbeelding. Probeer het later opnieuw.', 'Une erreur a été détectée lors du téléchargement de votre image. Veuillez réessayer ultérieurement.', 'Beim Hochladen des Bildes wurde ein Fehler gefunden. Bitte versuchen Sie es später erneut.', 'При загрузке изображения обнаружена ошибка. Повторите попытку позже.', 'Se ha encontrado un error al cargar tu imagen, inténtalo de nuevo más tarde.', 'Resminizi yüklerken hata bulundu, lütfen daha sonra tekrar deneyin.', 'आपकी छवि अपलोड करते समय त्रुटि मिली, कृपया बाद में पुन: प्रयास करें।', '上传图片时发现错误，请稍后重试。', 'آپ کی تصویر اپ لوڈ کرتے وقت خامی پائی گئی، براہ کرم بعد میں دوبارہ کوشش کریں۔', 'Kesalahan ditemukan saat mengunggah gambar Anda, coba lagi nanti.', 'Pronađena je pogreška prilikom učitavanja vaše slike, pokušajte ponovno kasnije.', 'נמצאה שגיאה בעת העלאת התמונה שלך, אנא נסה שוב מאוחר יותר.', 'আপনার ছবি আপলোড করার সময় ত্রুটি পাওয়া গেছে, অনুগ্রহ করে পরে আবার চেষ্টা করুন।', '画像のアップロード中にエラーが見つかりました。しばらくしてからもう一度お試しください。', 'هنگام آپلود تصویر شما خطایی پیدا شد، لطفاً بعداً دوباره امتحان کنید.', 'Ett fel hittades när du laddade upp din bild, försök igen senare.', 'Đã tìm thấy lỗi khi tải lên hình ảnh của bạn, vui lòng thử lại sau.', 'Der blev fundet en fejl under upload af dit billede. Prøv venligst igen senere.', 'May nakitang error habang ina-upload ang iyong larawan, pakisubukang muli sa ibang pagkakataon.', '이미지를 업로드하는 동안 오류가 발견되었습니다. 나중에 다시 시도해 주세요.'),
(142, '', '', 'error_found_while_uploading_your_track__please_try_again_later.', 'Error found while uploading your track, please try again later.', 'تم العثور على خطأ أثناء تحميل المسار ، يرجى المحاولة مرة أخرى لاحقًا.', 'Fout gevonden tijdens het uploaden van je nummer, probeer het later opnieuw.', 'Une erreur a été détectée lors du téléchargement de votre piste. Veuillez réessayer ultérieurement.', 'Fehler beim Hochladen Ihres Tracks. Bitte versuchen Sie es später erneut.', 'При загрузке трека обнаружена ошибка. Повторите попытку позже.', 'Se ha encontrado un error al cargar la pista. Inténtalo de nuevo más tarde.', 'Parça yüklenirken hata bulundu, lütfen daha sonra tekrar deneyin.', 'आपका ट्रैक अपलोड करते समय त्रुटि मिली, कृपया बाद में पुन: प्रयास करें।', '上传曲目时发现错误，请稍后重试。', 'آپ کا ٹریک اپ لوڈ کرتے وقت خرابی پائی گئی، براہ کرم بعد میں دوبارہ کوشش کریں۔', 'Kesalahan ditemukan saat mengunggah trek Anda, coba lagi nanti.', 'Pronađena je pogreška prilikom učitavanja vaše pjesme, pokušajte ponovno kasnije.', 'נמצאה שגיאה בעת העלאת הרצועה שלך, אנא נסה שוב מאוחר יותר.', 'আপনার ট্র্যাক আপলোড করার সময় ত্রুটি পাওয়া গেছে, অনুগ্রহ করে পরে আবার চেষ্টা করুন।', 'トラックのアップロード中にエラーが見つかりました。後でもう一度お試しください。', 'هنگام آپلود آهنگ شما خطایی پیدا شد، لطفاً بعداً دوباره امتحان کنید.', 'Ett fel hittades när du laddade upp din låt, försök igen senare.', 'Đã tìm thấy lỗi khi tải lên tuyến đường của bạn, vui lòng thử lại sau.', 'Der blev fundet en fejl under upload af dit nummer. Prøv venligst igen senere.', 'May nakitang error habang ina-upload ang iyong track, pakisubukang muli sa ibang pagkakataon.', '트랙을 업로드하는 동안 오류가 발견되었습니다. 나중에 다시 시도해 주세요.'),
(143, '', '', 'invalid_file_format__only_mp3__ogg__wav__and_mpeg_is_allowed', 'Invalid file format, only mp3, ogg, wav, and mpeg is allowed', 'يُسمح بتنسيق ملف غير صالح وملفات mp3 و ogg و wav و mpeg فقط', 'Ongeldige bestandsindeling, alleen mp3, ogg, wav en mpeg is toegestaan', 'Format de fichier invalide, seuls les fichiers mp3, ogg, wav et mpeg sont autorisés', 'Ungültiges Dateiformat, nur mp3, ogg, wav und mpeg ist zulässig', 'Неверный формат файла, разрешены только mp3, ogg, wav и mpeg', 'Formato de archivo no válido, solo se permite mp3, ogg, wav y mpeg', 'Geçersiz dosya formatı, yalnızca mp3, ogg, wav ve mpeg dosyalarına izin verilir', 'अमान्य फ़ाइल स्वरूप, केवल mp3, ogg, wav, और mpeg की अनुमति है', '文件格式无效，仅允许使用 mp3、ogg、wav 和 mpeg', 'غلط فائل فارمیٹ، صرف mp3، ogg، wav، اور mpeg کی اجازت ہے۔', 'Format file tidak valid, hanya mp3, ogg, wav, dan mpeg yang diperbolehkan', 'Nevažeći format datoteke, dopušteni su samo mp3, ogg, wav i mpeg', 'פורמט קובץ לא חוקי, רק mp3, ogg, wav ו-mpeg מותרים', 'অবৈধ ফাইল বিন্যাস, শুধুমাত্র mp3, ogg, wav, এবং mpeg অনুমোদিত', '無効なファイル形式です。mp3、ogg、wav、および mpeg のみが許可されています', 'فرمت فایل نامعتبر است، فقط mp3، ogg، wav و mpeg مجاز است', 'Ogiltigt filformat, endast mp3, ogg, wav och mpeg är tillåtna', 'Định dạng tệp không hợp lệ, chỉ cho phép mp3, ogg, wav và mpeg', 'Ugyldigt filformat, kun mp3, ogg, wav og mpeg er tilladt', 'Di-wastong format ng file, mp3, ogg, wav, at mpeg lang ang pinapayagan', '잘못된 파일 형식입니다. mp3, ogg, wav 및 mpeg만 허용됩니다.'),
(144, '', '', 'sorry__page_not_found_', 'Sorry, page not found!', 'عذرا، لم يتم العثور على الصفحة!', 'Sorry, pagina niet gevonden!', 'Désolé, page non trouvée!', 'Entschuldigung, Seite nicht gefunden!', 'Извините, страница не найдена!', 'Lo sentimos, la página no se encuentra!', 'Üzgünüz, sayfa bulunamadı!', 'क्षमा करें, पृष्ठ नहीं मिला!', '抱歉，找不到页面！', 'معذرت، صفحہ نہیں ملا!', 'Maaf, halaman tidak ditemukan!', 'Žao nam je, stranica nije pronađena!', 'סליחה, הדף לא נמצא!', 'দুঃখিত, পৃষ্ঠা পাওয়া যায়নি!', '申し訳ありませんが、ページが見つかりません!', 'با عرض پوزش، صفحه پیدا نشد!', 'Tyvärr, sidan hittades inte!', 'Xin lỗi, không tìm thấy trang!', 'Beklager, siden blev ikke fundet!', 'Paumanhin, hindi nahanap ang pahina!', '죄송합니다. 페이지를 찾을 수 없습니다!'),
(145, '', '', 'the_page_you_are_looking_for_could_not_be_found._please_check_the_link_you_followed_to_get_here_and_try_again.', 'The page you are looking for could not be found. Please check the link you followed to get here and try again.', 'لا يمكن العثور على الصفحة التي تبحث عنها. يرجى التحقق من الرابط الذي اتبعته للوصول إلى هنا والمحاولة مرة أخرى.', 'De pagina waarnaar u op zoek bent, kon niet worden gevonden. Controleer de link die je hebt gevolgd om hier te komen en probeer het opnieuw.', 'La page que vous recherchez n\'a pu être trouvée. Veuillez vérifier le lien que vous avez suivi pour arriver ici et réessayer.', 'Die von Ihnen gesuchte Seite wurde nicht gefunden. Bitte überprüfen Sie den Link, den Sie folgten, um hierher zu gelangen und es erneut zu versuchen.', 'Страница, которую вы ищете, не может быть найдена. Пожалуйста, проверьте ссылку, по которой вы перешли, и попробуйте снова.', 'La página que estás buscando no se pudo encontrar. Por favor revise el enlace que siguió para llegar aquí e intente nuevamente.', 'Aradığınız sayfa bulunamadı. Lütfen buraya gelip tekrar denediğiniz bağlantıyı kontrol edin.', 'आप जिस पेज की तलाश कर रहे हैं वह नहीं मिला। कृपया यहां पहुंचने के लिए आपके द्वारा अनुसरण किए गए लिंक की जांच करें और पुनः प्रयास करें।', '找不到您要查找的页面。请检查您到达此处的链接，然后重试。', 'آپ جس صفحہ کی تلاش کر رہے ہیں وہ نہیں مل سکا۔ براہ کرم یہاں آنے کے لیے جس لنک کی پیروی کی ہے اسے چیک کریں اور دوبارہ کوشش کریں۔', 'Halaman yang Anda cari tidak ditemukan. Silakan periksa tautan yang Anda ikuti untuk sampai ke sini dan coba lagi.', 'Stranica koju tražite nije pronađena. Provjerite vezu koju ste slijedili da biste došli ovdje i pokušajte ponovo.', 'הדף שאתה מחפש לא נמצא. אנא בדוק את הקישור שלחצת עליו כדי להגיע לכאן ונסה שוב.', 'আপনি যে পৃষ্ঠাটি খুঁজছেন তা খুঁজে পাওয়া যায়নি। এখানে পেতে অনুগ্রহ করে আপনি যে লিঙ্কটি অনুসরণ করেছেন তা চেক করুন এবং আবার চেষ্টা করুন।', 'お探しのページは見つかりませんでした。ここにアクセスするためにたどったリンクを確認して、もう一度お試しください。', 'صفحه مورد نظر شما یافت نشد. لطفاً پیوندی را که دنبال کردید بررسی کنید تا به اینجا برسید و دوباره امتحان کنید.', 'Sidan du letar efter kunde inte hittas. Kontrollera länken du följde för att komma hit och försök igen.', 'Không thể tìm thấy trang bạn đang tìm kiếm. Vui lòng kiểm tra liên kết bạn đã nhấp vào để đến đây và thử lại.', 'Den side, du leder efter, blev ikke fundet. Tjek venligst det link, du fulgte, for at komme hertil, og prøv igen.', 'Ang pahinang iyong hinahanap ay hindi matagpuan. Pakisuri ang link na iyong sinundan upang makarating dito at subukang muli.', '찾고 있는 페이지를 찾을 수 없습니다. 팔로우한 링크를 확인하여 여기로 이동한 후 다시 시도하세요.'),
