(234, '', '', 'please_upload_a_photo_with_your_passport___id___your_distinct_photo.', 'Please upload a photo with your passport / ID &amp; your distinct photo.', 'يرجى تحميل صورة مع جواز سفرك / معرفك &amp; ؛ صورتك المميزة.', 'Upload een foto met uw paspoort / ID &amp; jouw duidelijke foto.', 'Veuillez télécharger une photo avec votre passeport / ID &amp; votre photo distincte.', 'Bitte laden Sie ein Foto mit Ihrem Pass / ID &amp; Ihr unterschiedliches Foto.', 'Пожалуйста, загрузите фотографию с вашим паспортом / ID &amp; твое отличное фото.', 'Suba una foto con su pasaporte / ID &amp; tu foto distinta', 'Lütfen pasaportunuz / kimliğinizle bir fotoğraf yükleyin &amp; senin farklı fotoğrafın.', 'कृपया अपने पासपोर्ट / आईडी और अपनी अलग फोटो के साथ एक फोटो अपलोड करें।', '请上传带有您的护照/身份证和您的独特照片的照片。', 'براہ کرم اپنے پاسپورٹ/آئی ڈی اور اپنی الگ تصویر کے ساتھ ایک تصویر اپ لوڈ کریں۔', 'Harap unggah foto dengan paspor / ID Anda &amp; foto Anda yang berbeda.', 'Učitajte fotografiju s putovnicom/osobnom iskaznicom i svojom jasnom fotografijom.', 'אנא העלה תמונה עם הדרכון/תעודת הזהות שלך והתמונה הייחודית שלך.', 'আপনার পাসপোর্ট/আইডি এবং আপনার স্বতন্ত্র ফটো সহ একটি ফটো আপলোড করুন।', 'パスポート/身分証明書とあなたの特徴的な写真をアップロードしてください。', 'لطفا یک عکس با پاسپورت / شناسنامه و عکس متمایز خود آپلود کنید.', 'Vänligen ladda upp ett foto med ditt pass / ID och ditt distinkta foto.', 'Vui lòng tải lên ảnh có hộ chiếu / giấy tờ tùy thân và ảnh riêng biệt của bạn.', 'Upload venligst et billede med dit pas/id og dit særskilte billede.', 'Mangyaring mag-upload ng larawan kasama ang iyong pasaporte / ID at ang iyong natatanging larawan.', '여권/신분증 및 고유한 사진이 있는 사진을 업로드하세요.'),
