(238, '', '', 'we_will_review_your_request_within_24_hours__you_ll_be_informed_shourtly.', 'We will review your request within 24 hours, you&#039;ll be informed shourtly.', 'سنقوم بمراجعة طلبك خلال 24 ساعة ، وسيتم إبلاغك فورًا.', 'We zullen uw verzoek binnen 24 uur beoordelen, u wordt op de hoogte gebracht.', 'Nous examinerons votre demande dans les 24 heures, vous en serez informé.', 'Wir werden Ihre Anfrage innerhalb von 24 Stunden prüfen. Sie werden schnell informiert.', 'Мы рассмотрим ваш запрос в течение 24 часов, вы будете проинформированы.', 'Revisaremos su solicitud dentro de las 24 horas, se le informará brevemente.', 'İsteğinizi 24 saat içinde inceleyeceğiz, titizlikle bilgilendirileceksiniz.', 'हम 24 घंटे के भीतर आपके अनुरोध की समीक्षा करेंगे, आपको शीघ्र ही सूचित किया जाएगा।', '我们将在 24 小时内审核您的请求，并会尽快通知您。', 'ہم 24 گھنٹوں کے اندر آپ کی درخواست کا جائزہ لیں گے، آپ کو جلد ہی مطلع کیا جائے گا۔', 'Kami akan meninjau permintaan Anda dalam waktu 24 jam, Anda akan segera diberi tahu.', 'Pregledat ćemo vaš zahtjev u roku od 24 sata, o čemu ćete biti obaviješteni ubrzo.', 'אנו נבדוק את בקשתך תוך 24 שעות, תקבל הודעה בהקדם.', 'আমরা 24 ঘন্টার মধ্যে আপনার অনুরোধ পর্যালোচনা করব, আপনাকে শীঘ্রই জানানো হবে।', 'リクエストは 24 時間以内に確認され、すぐに通知されます。', 'ما درخواست شما را ظرف 24 ساعت بررسی می کنیم، به زودی به شما اطلاع داده می شود.', 'Vi kommer att granska din förfrågan inom 24 timmar, du kommer att informeras inom kort.', 'Chúng tôi sẽ xem xét yêu cầu của bạn trong vòng 24 giờ, bạn sẽ được thông báo ngay lập tức.', 'Vi gennemgår din anmodning inden for 24 timer, du vil blive informeret om kort tid.', 'Susuriin namin ang iyong kahilingan sa loob ng 24 na oras, aabisuhan ka kaagad.', '24시간 이내에 귀하의 요청을 검토하고 즉시 알려드리겠습니다.'),
(240, '', '', 'additional_details_about_your_self__optinal_', 'Additional details about your self (Optinal)', 'تفاصيل إضافية عن نفسك (Optinal)', 'Aanvullende informatie over jezelf (Optinal)', 'Détails supplémentaires sur vous-même (Optinal)', 'Zusätzliche Angaben zu Ihrer Person (Optinal)', 'Дополнительная информация о себе (Optinal)', 'Detalles adicionales sobre tu auto (Optinal)', 'Kendin hakkında ek ayrıntılar (Optinal)', 'अपने बारे में अतिरिक्त जानकारी (ऑप्टिल)', '关于您自己的其他详细信息（可选）', 'آپ کے بارے میں اضافی تفصیلات (اختیاری)', 'Detail tambahan tentang diri Anda (Optinal)', 'Dodatne pojedinosti o sebi (izborno)', 'פרטים נוספים על עצמך (אופטימלי)', 'আপনার নিজের সম্পর্কে অতিরিক্ত বিবরণ (অপটিনাল)', 'あなた自身に関する追加の詳細 (オプション)', 'جزئیات بیشتر در مورد خودتان (اختیاری)', 'Ytterligare information om dig själv (optinal)', 'Thông tin chi tiết bổ sung về bản thân của bạn (Optinal)', 'Yderligere oplysninger om dig selv (valgfrit)', 'Mga karagdagang detalye tungkol sa iyong sarili (Optinal)', '자신에 대한 추가 세부정보(선택사항)'),
(241, '', '', 'website__optional_', 'Website (Optional)', 'صفحة انترنت (اختياري)', 'Website (optioneel)', 'Site Internet (optionnel)', 'Webseite (optional)', 'Веб-сайт (необязательно)', 'Sitio web (opcional)', 'Web sitesi (İsteğe bağlı)', 'वेबसाइट (वैकल्पिक)', '网站（可选）', 'ویب سائٹ (اختیاری)', 'Situs Web (Opsional)', 'Web stranica (nije obavezno)', 'אתר (לא חובה)', 'ওয়েবসাইট (ঐচ্ছিক)', 'ウェブサイト (オプション)', 'وب سایت (اختیاری)', 'Webbplats (valfritt)', 'Trang web (Tùy chọn)', 'Hjemmeside (valgfrit)', 'Website (Opsyonal)', '웹사이트(선택사항)'),
(242, '', '', 'thank_you._your_request_has_been_sent__we_will_get_back_to_you_shourtly.', 'Thank you. Your request has been sent, we will get back to you shourtly.', 'شكرا لكم. تم إرسال طلبك ، وسنقوم بالرد عليك بسرعة.', 'Dank je. Uw verzoek is verzonden, wij nemen u zo snel mogelijk terug.', 'Je vous remercie. Votre demande a été envoyée, nous vous répondrons dans les meilleurs délais.', 'Vielen Dank. Ihre Anfrage wurde gesendet, wir melden uns umgehend bei Ihnen.', 'Спасибо. Ваша заявка отправлена, мы ответим вам срочно.', 'Gracias. Su solicitud ha sido enviada, nos pondremos en contacto con usted en breve.', 'Teşekkür ederim. İsteğiniz gönderildi, size sert bir şekilde geri döneceğiz.', 'शुक्रिया। आपका अनुरोध भेज दिया गया है, हम जल्द ही आपसे संपर्क करेंगे।', '谢谢你。您的请求已发送，我们会尽快回复您。', 'شکریہ آپ کی درخواست بھیج دی گئی ہے، ہم جلد ہی آپ سے رابطہ کریں گے۔', 'Terima kasih. Permintaan Anda telah dikirim, kami akan segera menghubungi Anda kembali.', 'Hvala vam. Vaš zahtjev je poslan, javit ćemo vam se ubrzo.', 'תודה. בקשתך נשלחה, אנו נחזור אליך בהקדם.', 'ধন্যবাদ. আপনার অনুরোধ পাঠানো হয়েছে, আমরা শীঘ্রই আপনার কাছে ফিরে পাব।', 'ありがとうございました。リクエストを送信しました。すぐにご連絡いたします。', 'متشکرم. درخواست شما ارسال شده است، ما به زودی با شما تماس خواهیم گرفت.', 'Tack. Din förfrågan har skickats, vi återkommer till dig inom kort.', 'Cảm ơn bạn. Yêu cầu của bạn đã được gửi đi, chúng tôi sẽ nhanh chóng liên hệ lại với bạn.', 'Tak skal du have. Din anmodning er sendt, vi vender tilbage til dig snarest.', 'Salamat. Naipadala na ang iyong kahilingan, babalikan ka namin kaagad.', '고맙습니다. 귀하의 요청이 전송되었습니다. 곧 연락드리겠습니다.'),
(243, '', '', 'error_found_while_processing_your_request__please_try_again_later.', 'Error found while processing your request, please try again later.', 'تم العثور على خطأ أثناء معالجة طلبك ، يرجى المحاولة مرة أخرى لاحقًا.', 'Fout gevonden tijdens het verwerken van uw verzoek. Probeer het later opnieuw.', 'Une erreur a été détectée lors du traitement de votre demande. Veuillez réessayer ultérieurement.', 'Fehler beim Verarbeiten Ihrer Anfrage, bitte versuchen Sie es später erneut.', 'При обработке вашего запроса обнаружена ошибка. Повторите попытку позже.', 'Se ha encontrado un error al procesar su solicitud, inténtelo de nuevo más tarde.', 'İsteğiniz işlenirken hata oluştu, lütfen daha sonra tekrar deneyin.', 'आपका अनुरोध संसाधित करते समय त्रुटि मिली, कृपया बाद में पुन: प्रयास करें।', '处理您的请求时发现错误，请稍后重试。', 'آپ کی درخواست پر کارروائی کرتے وقت خرابی پائی گئی، براہ کرم بعد میں دوبارہ کوشش کریں۔', 'Kesalahan ditemukan saat memproses permintaan Anda, coba lagi nanti.', 'Pronađena je pogreška tijekom obrade vašeg zahtjeva, pokušajte ponovno kasnije.', 'נמצאה שגיאה במהלך עיבוד בקשתך, אנא נסה שוב מאוחר יותר.', 'আপনার অনুরোধ প্রক্রিয়া করার সময় ত্রুটি পাওয়া গেছে, অনুগ্রহ করে পরে আবার চেষ্টা করুন।', 'リクエストの処理中にエラーが見つかりました。後でもう一度お試しください。', 'هنگام پردازش درخواست شما خطایی پیدا شد، لطفاً بعداً دوباره امتحان کنید.', 'Ett fel hittades när du bearbetade din begäran, försök igen senare.', 'Đã tìm thấy lỗi khi xử lý yêu cầu của bạn, vui lòng thử lại sau.', 'Der blev fundet en fejl under behandlingen af din anmodning. Prøv venligst igen senere.', 'May nakitang error habang pinoproseso ang iyong kahilingan, pakisubukang muli sa ibang pagkakataon.', '요청을 처리하는 동안 오류가 발견되었습니다. 나중에 다시 시도해 주세요.'),
(244, '', '', 'your_request_has_been_already_sent__we_will_get_back_to_you_shourtly.', 'Your request has been already sent, we will get back to you shourtly.', 'تم إرسال طلبك بالفعل ، وسنقوم بالرد عليك بسرعة.', 'Uw verzoek is al verzonden, we nemen u zo snel mogelijk terug.', 'Votre demande a déjà été envoyée, nous vous recontacterons dans les meilleurs délais.', 'Ihre Anfrage wurde bereits gesendet, wir melden uns umgehend bei Ihnen.', 'Ваша заявка уже отправлена, мы ответим вам срочно.', 'Su solicitud ya ha sido enviada, nos pondremos en contacto con usted en breve.', 'İsteğiniz zaten gönderildi, size sert bir şekilde geri döneceğiz.', 'आपका अनुरोध पहले ही भेजा जा चुका है, हम जल्द ही आपसे संपर्क करेंगे।', '您的请求已经发送，我们会尽快回复您。', 'آپ کی درخواست پہلے ہی بھیج دی گئی ہے، ہم جلد ہی آپ سے رابطہ کریں گے۔', 'Permintaan Anda telah dikirim, kami akan segera menghubungi Anda kembali.', 'Vaš zahtjev je već poslan, javit ćemo vam se ubrzo.', 'בקשתך כבר נשלחה, אנו נחזור אליך בהקדם.', 'আপনার অনুরোধ ইতিমধ্যেই পাঠানো হয়েছে, আমরা শীঘ্রই আপনার কাছে ফিরে আসব।', 'リクエストはすでに送信されています。すぐにご連絡いたします。', 'درخواست شما قبلا ارسال شده است، ما به زودی با شما تماس خواهیم گرفت.', 'Din förfrågan har redan skickats, vi återkommer till dig inom kort.', 'Yêu cầu của bạn đã được gửi đi, chúng tôi sẽ nhanh chóng liên hệ lại với bạn.', 'Din anmodning er allerede sendt, vi vender tilbage til dig snarest.', 'Naipadala na ang iyong kahilingan, babalikan ka namin kaagad.', '귀하의 요청은 이미 전송되었습니다. 곧 연락드리겠습니다.'),
(245, '', '', 'get_verified__upload_more_songs__get_more_space__sell_your_songs__get_a_special_looking_profile_and_get_famous_on_our_platform_', 'Get verified, upload more songs, get more space, sell your songs, get a special looking profile and get famous on our platform!', 'الحصول على التحقق ، تحميل المزيد من الأغاني ، الحصول على المزيد من المساحة ، بيع أغانيك ، الحصول على ملف تعريف ذو مظهر خاص والحصول على شهرة على نظامنا الأساسي!', 'Verifieer, upload meer nummers, krijg meer ruimte, verkoop je liedjes, krijg een speciaal uitziend profiel en word beroemd op ons platform!', 'Faites-vous vérifier, téléchargez plus de chansons, gagnez de l\'espace, vendez vos chansons, obtenez un profil spécial et devenez célèbre sur notre plateforme!', 'Lassen Sie sich verifizieren, laden Sie mehr Songs hoch, erhalten Sie mehr Platz, verkaufen Sie Ihre Songs, erhalten Sie ein spezielles Profil und werden Sie auf unserer Plattform berühmt!', 'Пройдите проверку, загрузите больше песен, получите больше места, продайте свои песни, получите специальный профиль и станьте известным на нашей платформе!', '¡Verifíquese, cargue más canciones, obtenga más espacio, venda sus canciones, obtenga un perfil de aspecto especial y sea famoso en nuestra plataforma!', 'Doğrulayın, daha fazla şarkı yükleyin, daha fazla alan kazanın, şarkılarınızı satın, özel bir görünüm elde edin ve platformumuzda ünlü olun!', 'सत्यापित हो जाएं, अधिक गाने अपलोड करें, अधिक स्थान प्राप्त करें, अपने गाने बेचें, एक विशेष दिखने वाली प्रोफ़ाइल प्राप्त करें और हमारे मंच पर प्रसिद्ध हों!', '获得验证，上传更多歌曲，获得更多空间，出售您的歌曲，获得特别的个人资料并在我们的平台上出名！', 'تصدیق حاصل کریں، مزید گانے اپ لوڈ کریں، مزید جگہ حاصل کریں، اپنے گانے فروخت کریں، ایک خاص نظر آنے والا پروفائل حاصل کریں اور ہمارے پلیٹ فارم پر مشہور ہو جائیں!', 'Dapatkan verifikasi, unggah lebih banyak lagu, dapatkan lebih banyak ruang, jual lagu Anda, dapatkan profil yang tampak istimewa, dan jadilah terkenal di platform kami!', 'Potvrdite se, učitajte više pjesama, nabavite više prostora, prodajte svoje pjesme, steknite profil posebnog izgleda i proslavite se na našoj platformi!', 'קבל אימות, העלה שירים נוספים, קבל יותר מקום, מכור את השירים שלך, קבל פרופיל בעל מראה מיוחד והתפרסם בפלטפורמה שלנו!', 'যাচাই করুন, আরও গান আপলোড করুন, আরও জায়গা পান, আপনার গান বিক্রি করুন, একটি বিশেষ লুকিং প্রোফাইল পান এবং আমাদের প্ল্যাটফর্মে বিখ্যাত হন!', '認証を受け、より多くの曲をアップロードし、より多くのスペースを獲得し、曲を販売し、特別な外観のプロファイルを取得して、プラットフォームで有名になりましょう!', 'تأیید شوید، آهنگ‌های بیشتری آپلود کنید، فضای بیشتری دریافت کنید، آهنگ‌های خود را بفروشید، نمایه‌ای خاص داشته باشید و در پلتفرم ما مشهور شوید!', 'Bli verifierad, ladda upp fler låtar, få mer utrymme, sälj dina låtar, få en speciell profil och bli känd på vår plattform!', 'Được xác minh, tải lên nhiều bài hát hơn, có thêm dung lượng, bán bài hát của bạn, có được một hồ sơ đặc biệt và trở nên nổi tiếng trên nền tảng của chúng tôi!', 'Bliv verificeret, upload flere sange, få mere plads, sælg dine sange, få en særlig udseende profil og bliv berømt på vores platform!', 'Magpa-verify, mag-upload ng higit pang mga kanta, makakuha ng mas maraming espasyo, ibenta ang iyong mga kanta, makakuha ng isang espesyal na mukhang profile at sumikat sa aming platform!', '인증을 받고, 더 많은 노래를 업로드하고, 더 많은 공간을 확보하고, 노래를 판매하고, 특별해 보이는 프로필을 얻고, 우리 플랫폼에서 유명해집니다!'),
