(254, '', '', 'congratulations__your_request_to_become_an_artist_was_approved.', 'Congratulations! Your request to become an artist was approved.', 'تهانينا! تمت الموافقة على طلبك لتصبح فنانا.', 'Gefeliciteerd! Uw verzoek om artiest te worden is goedgekeurd.', 'Toutes nos félicitations! Votre demande de devenir artiste a été approuvée.', 'Herzliche Glückwünsche! Ihre Anfrage, Künstler zu werden, wurde genehmigt.', 'Поздравляем! Ваш запрос стать художником был одобрен.', '¡Felicidades! Su solicitud para convertirse en un artista fue aprobada.', 'Tebrikler! Sanatçı olma isteğiniz onaylandı.', 'बधाई हो! कलाकार बनने का आपका अनुरोध स्वीकार कर लिया गया था।', '恭喜！您成为艺术家的请求已获批准。', 'مبارک ہو! فنکار بننے کی آپ کی درخواست منظور کر لی گئی۔', 'Selamat! Permintaan Anda untuk menjadi artis telah disetujui.', 'Čestitamo! Vaš zahtjev da postanete umjetnik je odobren.', 'מזל טוב! בקשתך להיות אמן אושרה.', 'অভিনন্দন! একজন শিল্পী হওয়ার জন্য আপনার অনুরোধ অনুমোদিত হয়েছে।', 'おめでとう！アーティストになるリクエストが承認されました。', 'تبریک می گویم! درخواست شما برای هنرمند شدن تایید شد.', 'Grattis! Din begäran om att bli artist godkändes.', 'Xin chúc mừng! Yêu cầu trở thành nghệ sĩ của bạn đã được chấp thuận.', 'Tillykke! Din anmodning om at blive kunstner blev godkendt.', 'Binabati kita! Naaprubahan ang iyong kahilingang maging artista.', '축하합니다! 아티스트가 되기 위한 귀하의 요청이 승인되었습니다.'),
(255, '', '', 'sadly__your_request_to_become_an_artist_was_declined.', 'Sadly, Your request to become an artist was declined.', 'للأسف ، تم رفض طلبك لتصبح فنانا.', 'Helaas is je verzoek om artiest te worden afgewezen.', 'Malheureusement, votre demande de devenir artiste a été refusée.', 'Leider wurde Ihre Bitte, Künstler zu werden, abgelehnt.', 'К сожалению, ваша просьба стать художником была отклонена.', 'Lamentablemente, su solicitud para convertirse en un artista fue rechazada.', 'Ne yazık ki, sanatçı olma isteğiniz reddedildi.', 'दुख की बात है कि कलाकार बनने का आपका अनुरोध अस्वीकार कर दिया गया था।', '很遗憾，您成为艺术家的请求被拒绝了。', 'افسوس کی بات ہے کہ آپ کی فنکار بننے کی درخواست مسترد کر دی گئی۔', 'Sayangnya, permintaan Anda untuk menjadi artis ditolak.', 'Nažalost, vaš zahtjev da postanete umjetnik je odbijen.', 'למרבה הצער, בקשתך להפוך לאמן נדחתה.', 'দুঃখের বিষয়, আপনার শিল্পী হওয়ার অনুরোধ প্রত্যাখ্যান করা হয়েছে।', '残念ながら、アーティストになるためのあなたのリクエストは拒否されました。', 'متأسفانه درخواست شما برای هنرمند شدن رد شد.', 'Tyvärr avvisades din begäran om att bli artist.', 'Rất tiếc, yêu cầu trở thành nghệ sĩ của bạn đã bị từ chối.', 'Desværre blev din anmodning om at blive kunstner afvist.', 'Nakalulungkot, tinanggihan ang iyong kahilingang maging artista.', '안타깝게도 아티스트가 되기 위한 귀하의 요청은 거부되었습니다.'),
