(347, '', '', 'unexpected_error_found_while_processing_your_payment__please_try_again_later.', 'Unexpected error found while processing your payment, please try again later.', 'تم العثور على خطأ غير متوقع أثناء معالجة دفعتك ، يرجى إعادة المحاولة لاحقًا.', 'Onverwachte fout gevonden tijdens het verwerken van uw betaling, probeer het later opnieuw.', 'Une erreur inattendue a été détectée lors du traitement de votre paiement. Veuillez réessayer ultérieurement.', 'Bei der Verarbeitung Ihrer Zahlung wurde ein unerwarteter Fehler gefunden. Bitte versuchen Sie es später erneut.', 'При обработке вашего платежа обнаружена непредвиденная ошибка, повторите попытку позже.', 'Se ha encontrado un error inesperado al procesar su pago. Inténtelo de nuevo más tarde.', 'Ödemeniz işlenirken beklenmeyen bir hata bulundu, lütfen daha sonra tekrar deneyin.', 'आपका भुगतान संसाधित करते समय अनपेक्षित त्रुटि मिली, कृपया बाद में पुन: प्रयास करें।', '处理您的付款时发现意外错误，请稍后再试。', 'آپ کی ادائیگی پر کارروائی کے دوران غیر متوقع خرابی پائی گئی، براہ کرم بعد میں دوبارہ کوشش کریں۔', 'Kesalahan tak terduga ditemukan saat memproses pembayaran Anda, harap coba lagi nanti.', 'Pronađena je neočekivana pogreška tijekom obrade vašeg plaćanja, pokušajte ponovno kasnije.', 'נמצאה שגיאה לא צפויה במהלך עיבוד התשלום שלך, אנא נסה שוב מאוחר יותר.', 'আপনার পেমেন্ট প্রক্রিয়া করার সময় অপ্রত্যাশিত ত্রুটি পাওয়া গেছে, অনুগ্রহ করে পরে আবার চেষ্টা করুন।', 'お支払いの処理中に予期しないエラーが見つかりました。後でもう一度お試しください。', 'هنگام پردازش پرداخت شما خطای غیرمنتظره ای پیدا شد، لطفاً بعداً دوباره امتحان کنید.', 'Ett oväntat fel hittades när din betalning bearbetades, försök igen senare.', 'Đã tìm thấy lỗi không mong muốn khi xử lý thanh toán của bạn, vui lòng thử lại sau.', 'Der blev fundet en uventet fejl under behandling af din betaling. Prøv venligst igen senere.', 'May nakitang hindi inaasahang error habang pinoproseso ang iyong pagbabayad, pakisubukang muli sa ibang pagkakataon.', '결제를 처리하는 동안 예기치 않은 오류가 발견되었습니다. 나중에 다시 시도해 주세요.'),
