(353, '', '', 'you_have_reached_your_upload_limit___link__to_upload_unlimited_songs.', 'You have reached your upload limit, |link| to upload unlimited songs.', 'لقد وصلت إلى الحد الأقصى للتحميل ، |link| لتحميل الأغاني غير محدودة.', 'Je hebt je uploadlimiet bereikt, |link| om onbeperkte nummers te uploaden.', 'Vous avez atteint votre limite de téléchargement, |link| télécharger des chansons illimitées.', 'Sie haben Ihr Upload-Limit erreicht, |link| unbegrenzt Songs hochladen.', 'Вы достигли лимита загрузки, |link| загружать неограниченное количество песен.', 'Has alcanzado tu límite de subida, |link| para subir canciones ilimitadas.', 'Yükleme sınırınıza ulaştınız, |link| sınırsız şarkı yüklemek için.', 'आप अपनी अपलोड सीमा तक पहुँच चुके हैं, |लिंक| असीमित गाने अपलोड करने के लिए।', '您已达到上传限制，|link|上传无限的歌曲。', 'آپ اپ لوڈ کی حد تک پہنچ گئے ہیں، |لنک| لامحدود گانے اپ لوڈ کرنے کے لیے۔', 'Anda telah mencapai batas upload, |link| untuk mengunggah lagu tanpa batas.', 'Dosegli ste ograničenje učitavanja, |link| za prijenos neograničenog broja pjesama.', 'הגעת למגבלת ההעלאה שלך, |קישור| להעלות שירים ללא הגבלה.', 'আপনি আপনার আপলোড সীমায় পৌঁছেছেন, |লিংক| সীমাহীন গান আপলোড করতে।', 'アップロードの上限に達しました |link|無制限の曲をアップロードします。', 'شما به حد مجاز آپلود خود رسیده اید، |link| برای آپلود آهنگ های نامحدود', 'Du har nått din uppladdningsgräns, |länk| att ladda upp obegränsat med låtar.', 'Bạn đã đạt đến giới hạn tải lên của mình, | link | để tải lên các bài hát không giới hạn.', 'Du har nået din uploadgrænse, |link| at uploade ubegrænset sange.', 'Naabot mo na ang iyong limitasyon sa pag-upload, |link| upang mag-upload ng walang limitasyong mga kanta.', '업로드 한도에 도달했습니다. |link| 무제한 노래를 업로드합니다.'),
(354, '', '', 'get_verified__sell_your_songs__get_a_special_looking_profile_and_get_famous_on_our_platform_', 'Get verified, sell your songs, get a special looking profile and get famous on our platform!', 'الحصول على التحقق ، بيع أغانيك ، والحصول على ملف تعريف خاص المظهر والحصول على شهرة على منصة لدينا!', 'Wordt geverifieerd, verkoop je liedjes, krijg een speciaal uitziend profiel en word beroemd op ons platform!', 'Faites-vous vérifier, vendez vos chansons, obtenez un profil spécial et devenez célèbre sur notre plateforme!', 'Lassen Sie sich verifizieren, verkaufen Sie Ihre Songs, erhalten Sie ein speziell aussehendes Profil und werden Sie auf unserer Plattform berühmt!', 'Пройдите проверку, продайте свои песни, получите специальный профиль и станьте известным на нашей платформе!', '¡Verifíquese, venda sus canciones, obtenga un perfil especial y vuélvase famoso en nuestra plataforma!', 'Doğrulayın, şarkılarınızı satın, özel bir görünüme sahip olun ve platformumuzda ünlü olun!', 'सत्यापित हो जाओ, अपने गाने बेचो, एक विशेष दिखने वाली प्रोफ़ाइल प्राप्त करो और हमारे मंच पर प्रसिद्ध हो जाओ!', '获得验证，出售您的歌曲，获得特别的个人资料并在我们的平台上出名！', 'تصدیق حاصل کریں، اپنے گانے فروخت کریں، ایک خاص نظر آنے والا پروفائل حاصل کریں اور ہمارے پلیٹ فارم پر مشہور ہو جائیں!', 'Dapatkan verifikasi, jual lagu Anda, dapatkan profil yang tampak istimewa, dan jadilah terkenal di platform kami!', 'Provjerite se, prodajte svoje pjesme, steknite profil posebnog izgleda i proslavite se na našoj platformi!', 'קבל אימות, מכור את השירים שלך, קבל פרופיל בעל מראה מיוחד והתפרסם בפלטפורמה שלנו!', 'যাচাই করুন, আপনার গান বিক্রি করুন, একটি বিশেষ লুকিং প্রোফাইল পান এবং আমাদের প্ল্যাটফর্মে বিখ্যাত হন!', '認証を受けて、あなたの曲を販売し、特別なプロフィールを手に入れて、私たちのプラットフォームで有名になりましょう!', 'تأیید شوید، آهنگ های خود را بفروشید، نمایه ای خاص به دست آورید و در پلت فرم ما مشهور شوید!', 'Bli verifierad, sälj dina låtar, få en speciell profil och bli känd på vår plattform!', 'Được xác minh, bán các bài hát của bạn, có được một hồ sơ đặc biệt và trở nên nổi tiếng trên nền tảng của chúng tôi!', 'Bliv verificeret, sælg dine sange, få en særlig udseende profil og bliv berømt på vores platform!', 'Magpa-verify, ibenta ang iyong mga kanta, makakuha ng isang espesyal na naghahanap ng profile at sumikat sa aming platform!', '인증을 받고, 노래를 판매하고, 특별해 보이는 프로필을 얻고, 우리 플랫폼에서 유명해집니다!'),
