(407, '', '', 'create_dmca_take_down_notice', 'Create DMCA take down notice', 'إنشاء DMCA إنزال إشعار', 'Maak een DMCA-kennisgeving voor verwijdering', 'Créer un avis de DMCA', 'Erstellen Sie eine DMCA-Benachrichtigung', 'Создать DMCA снять уведомление', 'Crear aviso de eliminación de DMCA', 'DMCA oluşturma bildirimi al', 'DMCA टेक डाउन नोटिस बनाएं', '创建 DMCA 删除通知', 'DMCA ٹیک ڈاؤن نوٹس بنائیں', 'Buat pemberitahuan penghapusan DMCA', 'Izradite DMCA obavijest o uklanjanju', 'צור הודעת הסרה של DMCA', 'DMCA টেক ডাউন নোটিশ তৈরি করুন', 'DMCA 削除通知を作成する', 'اخطار حذف DMCA ایجاد کنید', 'Skapa meddelande om DMCA-borttagning', 'Tạo thông báo gỡ xuống DMCA', 'Opret DMCA-meddelelse om fjernelse', 'Gumawa ng DMCA take down notice', 'DMCA 게시 중단 알림 만들기'),
(408, '', '', 'i_have_a_good_faith_belief_that_use_of_the_copyrighted_work_described_above_is_not_authorized_by_the_copyright_owner__its_agent_or_the_law', 'I have a good faith belief that use of the copyrighted work described above is not authorized by the copyright owner, its agent or the law', 'لدي اعتقاد حسن النية بأن استخدام العمل المحمي بحقوق الطبع والنشر الموضح أعلاه غير مصرح به من قبل مالك حقوق الطبع والنشر أو وكيله أو القانون', 'Ik ben er te goeder trouw van overtuigd dat het gebruik van het auteursrechtelijk beschermde werk zoals hierboven beschreven niet is geautoriseerd door de eigenaar van het auteursrecht, diens vertegenwoordiger of de wet', 'J\'ai la conviction de bonne foi que l\'utilisation de l\'œuvre protégée par le droit d\'auteur décrite ci-dessus n\'est pas autorisée par le titulaire du droit d\'auteur, son agent ou la loi', 'Ich bin fest davon überzeugt, dass die Verwendung des oben beschriebenen urheberrechtlich geschützten Werks nicht vom Inhaber des Urheberrechts, seinem Vertreter oder dem Gesetz genehmigt wird', 'Я добросовестно полагаю, что использование авторских прав, описанных выше, не разрешено владельцем авторских прав, его агентом или законом', 'Creo de buena fe que el uso del trabajo con derechos de autor descrito anteriormente no está autorizado por el propietario de los derechos de autor, su agente o la ley', 'Yukarıda açıklanan telif hakkı alınmış çalışmanın kullanımının telif hakkı sahibi, vekili veya yasa tarafından yetkilendirilmediğine dair iyi bir inancım var.', 'मुझे अच्छा विश्वास है कि ऊपर वर्णित कॉपीराइट कार्य का उपयोग कॉपीराइट स्वामी, उसके एजेंट या कानून द्वारा अधिकृत नहीं है', '我确信使用上述受版权保护的作品未经版权所有者、其代理人或法律授权', 'مجھے نیک نیتی سے یقین ہے کہ اوپر بیان کردہ کاپی رائٹ شدہ کام کا استعمال کاپی رائٹ کے مالک، اس کے ایجنٹ یا قانون کے ذریعہ مجاز نہیں ہے', 'Saya yakin dengan niat baik bahwa penggunaan karya berhak cipta yang dijelaskan di atas tidak diizinkan oleh pemilik hak cipta, agennya, atau hukum', 'U dobroj vjeri vjerujem da korištenje gore opisanog djela zaštićenog autorskim pravima nije ovlašteno od strane vlasnika autorskih prava, njegovog predstavnika ili zakona', 'אני מאמין בתום לב שהשימוש ביצירה המוגנת בזכויות יוצרים המתוארת לעיל אינו מורשה על ידי בעל זכויות היוצרים, סוכנו או החוק', 'আমার সৎ বিশ্বাস আছে যে উপরে বর্ণিত কপিরাইটযুক্ত কাজের ব্যবহার কপিরাইট মালিক, এর এজেন্ট বা আইন দ্বারা অনুমোদিত নয়', '私は、上記の著作物の使用が、著作権所有者、その代理人、または法律によって許可されていないことを確信しています。', 'من با حسن نیت اعتقاد دارم که استفاده از اثر دارای حق نسخه برداری که در بالا توضیح داده شد توسط مالک حق نسخه برداری، نماینده آن یا قانون مجاز نیست', 'Jag tror i god tro att användningen av det upphovsrättsskyddade verket som beskrivs ovan inte är auktoriserat av upphovsrättsinnehavaren, dess agent eller lagen', 'Tôi thực sự tin rằng việc sử dụng tác phẩm có bản quyền được mô tả ở trên không được chủ sở hữu bản quyền, đại diện của chủ sở hữu bản quyền hoặc luật pháp cho phép', 'Jeg er i god tro overbevist om, at brugen af det ophavsretsligt beskyttede værk beskrevet ovenfor ikke er godkendt af ejeren af ophavsretten, dennes agent eller loven', 'Mayroon akong magandang loob na paniniwala na ang paggamit ng naka-copyright na gawa na inilarawan sa itaas ay hindi pinahihintulutan ng may-ari ng copyright, ahente nito o ng batas', '본인은 위에 설명된 저작권이 있는 저작물의 사용이 저작권 소유자, 그 대리인 또는 법률에 의해 승인되지 않았다고 믿습니다.'),
(409, '', '', 'i_confirm_that_i_am_the_copyright_owner_or_am_authorised_to_act_on_behalf_of_the_owner_of_an_exclusive_right_that_is_allegedly_infringed.', 'I confirm that I am the copyright owner or am authorised to act on behalf of the owner of an exclusive right that is allegedly infringed.', 'أؤكد أنني مالك حقوق الطبع والنشر أو مفوض بالتصرف نيابة عن مالك الحق الحصري المزعوم انتهاكه.', 'Ik bevestig dat ik de eigenaar van het auteursrecht ben of bevoegd ben om namens de eigenaar van een exclusief recht te handelen dat mogelijk is geschonden.', 'Je confirme que je suis le titulaire du droit d\'auteur ou que je suis autorisé à agir pour le compte du titulaire d\'un droit exclusif prétendument violé.', 'Ich bestätige, dass ich der Inhaber des Urheberrechts bin oder befugt bin, im Namen des Inhabers eines ausschließlichen Rechts zu handeln, das angeblich verletzt wird.', 'Я подтверждаю, что являюсь владельцем авторских прав или уполномочен действовать от имени владельца исключительного права, которое предположительно нарушено.', 'Confirmo que soy el propietario de los derechos de autor o que estoy autorizado para actuar en nombre del propietario de un derecho exclusivo que presuntamente se ha infringido.', 'Telif hakkı sahibinin ya da ihlal edildiği iddia edilen münhasır bir hak sahibi adına hareket etmeye yetkili olduğumu onaylarım.', 'मैं पुष्टि करता हूं कि मैं कॉपीराइट का स्वामी हूं या एक विशेष अधिकार के स्वामी की ओर से कार्य करने के लिए अधिकृत हूं जिसका कथित रूप से उल्लंघन किया गया है।', '我确认我是版权所有者或被授权代表涉嫌侵权的专有权所有者行事。', 'میں تصدیق کرتا ہوں کہ میں کاپی رائٹ کا مالک ہوں یا کسی ایسے خصوصی حق کے مالک کی جانب سے کارروائی کرنے کا مجاز ہوں جس کی مبینہ طور پر خلاف ورزی کی گئی ہو۔', 'Saya menegaskan bahwa saya adalah pemilik hak cipta atau berwenang untuk bertindak atas nama pemilik hak eksklusif yang diduga dilanggar.', 'Potvrđujem da sam vlasnik autorskih prava ili da sam ovlašten djelovati u ime vlasnika isključivog prava koje je navodno povrijeđeno.', 'אני מאשר שאני הבעלים של זכויות היוצרים או מורשה לפעול בשמו של הבעלים של זכות בלעדית שהופרה לכאורה.', 'আমি নিশ্চিত করছি যে আমি কপিরাইটের মালিক বা আমি লঙ্ঘন করা একচেটিয়া অধিকারের মালিকের পক্ষে কাজ করার জন্য অনুমোদিত৷', '私は、私が著作権所有者であるか、または侵害されているとされる独占権の所有者に代わって行動する権限を与えられていることを確認します.', 'من تأیید می‌کنم که مالک حق نسخه‌برداری هستم یا مجازم از طرف مالک حق انحصاری که ادعا می‌شود نقض شده است اقدام کنم.', 'Jag bekräftar att jag är upphovsrättsinnehavaren eller är behörig att agera på uppdrag av ägaren av en exklusiv rättighet som påstås ha kränkts.', 'Tôi xác nhận rằng tôi là chủ sở hữu bản quyền hoặc được ủy quyền thay mặt cho chủ sở hữu độc quyền bị cáo buộc là vi phạm.', 'Jeg bekræfter, at jeg er ophavsretsejeren eller er autoriseret til at handle på vegne af ejeren af en eksklusiv rettighed, der angiveligt er krænket.', 'Kinukumpirma ko na ako ang may-ari ng copyright o awtorisado akong kumilos sa ngalan ng may-ari ng isang eksklusibong karapatan na di-umano&#39;y nilabag.', '본인은 저작권 소유자이거나 침해된 것으로 의심되는 독점권 소유자를 대리할 권한이 있음을 확인합니다.'),
(410, '', '', 'submit', 'Submit', 'خضع', 'voorleggen', 'Soumettre', 'einreichen', 'Отправить', 'Enviar', 'Gönder', 'प्रस्तुत करना', '提交', 'جمع کرائیں', 'Kirim', 'podnijeti', 'שלח', 'জমা দিন', '送信', 'ارسال', 'Skicka in', 'Nộp', 'Indsend', 'Ipasa', '제출하다'),
(411, '', '', 'please_describe_your_request_carefully_and_as_much_as_you_can__note_that_false_dmca_requests_can_lead_to_account_termination.', 'Please describe your request carefully and as much as you can, note that false DMCA requests can lead to account termination.', 'يرجى وصف طلبك بعناية وبقدر ما تستطيع ، لاحظ أن طلبات قانون الألفية الجديدة لحقوق طبع ونشر المواد الرقمية يمكن أن تؤدي إلى إنهاء الحساب.', 'Beschrijf uw verzoek zorgvuldig en voorzover mogelijk, kunnen valse DMCA-verzoeken leiden tot beëindiging van uw account.', 'Veuillez décrire votre demande avec soin et, dans la mesure du possible, notez que les fausses demandes DMCA peuvent entraîner la fermeture du compte.', 'Bitte beschreiben Sie Ihre Anfrage sorgfältig und so oft Sie können. Beachten Sie, dass falsche DMCA-Anfragen zur Kontoauflösung führen können.', 'Пожалуйста, опишите ваш запрос внимательно и как можно больше, обратите внимание, что ложные запросы DMCA могут привести к удалению аккаунта.', 'Describa su solicitud con cuidado y tanto como pueda, tenga en cuenta que las solicitudes falsas de DMCA pueden llevar a la cancelación de la cuenta.', 'Lütfen isteğinizi dikkatlice ve mümkün olduğunca açıklayın, yanlış DMCA taleplerinin hesabınızın feshine yol açabileceğini unutmayın.', 'कृपया अपने अनुरोध का ध्यानपूर्वक वर्णन करें और जितना हो सके, ध्यान दें कि झूठे DMCA अनुरोधों से खाता समाप्त किया जा सकता है।', '请尽可能详细地描述您的请求，注意虚假的 DMCA 请求可能导致帐户终止。', 'براہ کرم اپنی درخواست کو احتیاط سے بیان کریں اور جتنا ہو سکے، نوٹ کریں کہ DMCA کی غلط درخواستیں اکاؤنٹ کو ختم کرنے کا باعث بن سکتی ہیں۔', 'Harap jelaskan permintaan Anda dengan hati-hati dan sebanyak yang Anda bisa, perhatikan bahwa permintaan DMCA palsu dapat menyebabkan penghentian akun.', 'Pažljivo opišite svoj zahtjev i koliko god možete imajte na umu da lažni DMCA zahtjevi mogu dovesti do ukidanja računa.', 'אנא תאר את בקשתך בקפידה ובמידת האפשר, שים לב שבקשות DMCA כוזבות עלולות להוביל לסגירת חשבון.', 'অনুগ্রহ করে আপনার অনুরোধটি সাবধানতার সাথে বর্ণনা করুন এবং আপনি যতটা পারেন, মনে রাখবেন যে মিথ্যা DMCA অনুরোধগুলি অ্যাকাউন্ট বন্ধ করে দিতে পারে।', 'リクエストを慎重に説明してください。可能な限り、虚偽の DMCA リクエストはアカウントの停止につながる可能性があることに注意してください。', 'لطفاً درخواست خود را با دقت شرح دهید و تا جایی که می توانید، توجه داشته باشید که درخواست های نادرست DMCA می تواند منجر به فسخ حساب شود.', 'Beskriv din begäran noggrant och så mycket du kan. Observera att falska DMCA-förfrågningar kan leda till att kontot avslutas.', 'Vui lòng mô tả yêu cầu của bạn một cách cẩn thận và nhiều nhất có thể, lưu ý rằng các yêu cầu DMCA sai có thể dẫn đến việc chấm dứt tài khoản.', 'Beskriv venligst din anmodning omhyggeligt og så meget som muligt. Bemærk, at falske DMCA-anmodninger kan føre til kontolukning.', 'Pakilarawan nang mabuti ang iyong kahilingan at hangga&#39;t kaya mo, tandaan na ang mga maling kahilingan sa DMCA ay maaaring humantong sa pagwawakas ng account.', '귀하의 요청을 주의 깊게 설명하고 가능한 한 많이, 허위 DMCA 요청은 계정 해지로 이어질 수 있다는 점에 유의하십시오.'),
(412, '', '', 'please_describe_your_request.', 'Please describe your request.', 'يرجى وصف طلبك.', 'Beschrijf alstublieft uw verzoek.', 'S\'il vous plaît décrire votre demande.', 'Bitte beschreiben Sie Ihre Anfrage.', 'Пожалуйста, опишите ваш запрос.', 'Por favor describa su solicitud.', 'Lütfen isteğinizi tanımlayın.', 'कृपया अपने अनुरोध का वर्णन करें।', '请描述您的要求。', 'براہ کرم اپنی درخواست کی وضاحت کریں۔', 'Jelaskan permintaan Anda.', 'Molimo opišite svoj zahtjev.', 'אנא תאר את בקשתך.', 'আপনার অনুরোধ বর্ণনা করুন.', 'ご要望をご記入ください。', 'لطفا درخواست خود را شرح دهید.', 'Beskriv din förfrågan.', 'Vui lòng mô tả yêu cầu của bạn.', 'Beskriv venligst din anmodning.', 'Pakilarawan ang iyong kahilingan.', '귀하의 요청을 설명하십시오.'),
(413, '', '', 'please_select_the_checkboxs_below_if_you_own_the_copyright.', 'Please select the checkboxs below if you own the copyright.', 'يرجى تحديد مربعات الاختيار أدناه إذا كنت تملك حقوق الطبع والنشر.', 'Selecteer de selectievakjes hieronder als u de eigenaar bent van het auteursrecht.', 'Veuillez cocher les cases ci-dessous si vous possédez le droit d\'auteur.', 'Bitte wählen Sie die folgenden Kontrollkästchen aus, wenn Sie das Urheberrecht besitzen.', 'Пожалуйста, установите флажки ниже, если вы являетесь владельцем авторских прав.', 'Por favor, seleccione las casillas de verificación a continuación si posee los derechos de autor.', 'Telif hakkına sahipseniz lütfen aşağıdaki onay kutularını seçin.', 'यदि आप कॉपीराइट के स्वामी हैं, तो कृपया नीचे दिए गए चेकबॉक्स का चयन करें।', '如果您拥有版权，请选中下面的复选框。', 'اگر آپ کاپی رائٹ کے مالک ہیں تو براہ کرم نیچے چیک باکسز کو منتخب کریں۔', 'Harap pilih kotak centang di bawah jika Anda memiliki hak cipta.', 'Odaberite potvrdne okvire ispod ako ste vlasnik autorskih prava.', 'אנא בחר את תיבות הסימון למטה אם אתה הבעלים של זכויות היוצרים.', 'আপনি কপিরাইট মালিক যদি নীচের চেকবক্স নির্বাচন করুন.', '著作権を所有している場合は、以下のチェックボックスを選択してください。', 'در صورتی که حق چاپ را دارید، لطفاً کادرهای زیر را انتخاب کنید.', 'Markera kryssrutorna nedan om du äger upphovsrätten.', 'Vui lòng chọn các hộp kiểm bên dưới nếu bạn sở hữu bản quyền.', 'Vælg venligst afkrydsningsfelterne nedenfor, hvis du ejer ophavsretten.', 'Mangyaring piliin ang mga checkbox sa ibaba kung pagmamay-ari mo ang copyright.', '저작권이 있는 경우 아래 확인란을 선택하십시오.'),
