(505, '', '', 'listen_to_songs', 'Listen to Songs', 'اسمع الاغاني', 'Luister naar liedjes', 'Ecouter des chansons', 'Lieder hören', 'Слушать песни', 'Escuchar canciones', 'Şarkıları dinle', 'गाने सुनना', '听歌', 'گانے سنیں۔', 'Mendengarkan lagu', 'Slušajte pjesme', 'להקשיב לשירים', 'গান শুনুন', '曲を聴く', 'آهنگ ها را گوش کنید', 'Lyssna på sånger', 'Nghe các bài hát', 'Lyt til sange', 'Makinig sa Mga Kanta', '노래 듣기'),
(506, '', '', 'discover__stream__and_share_a_constantly_expanding_mix_of_music_from_emerging_and_major_artists_around_the_world.', 'Discover, stream, and share a constantly expanding mix of music from emerging and major artists around the world.', 'اكتشف مجموعة من الموسيقى المتنامية باستمرار من فنانين ناشئين وكبار في جميع أنحاء العالم ، وقم بدفقها ومشاركتها.', 'Ontdek, stream en deel een constant groeiende mix van muziek van opkomende en grote artiesten over de hele wereld.', 'Découvrez, diffusez en streaming et partagez un mélange sans cesse croissant de musique d\'artistes émergents et majeurs du monde entier.', 'Entdecken, streamen und teilen Sie eine ständig wachsende Mischung aus Musik von aufstrebenden und bedeutenden Künstlern auf der ganzen Welt.', 'Откройте для себя, транслируйте и делитесь постоянно растущим миксом музыки от начинающих и крупных артистов по всему миру.', 'Descubra, transmita y comparta una mezcla de música en constante expansión de artistas emergentes e importantes de todo el mundo.', 'Dünyadaki yeni ve büyük sanatçıların sürekli genişleyen bir müzik karışımını keşfedin, yayınlayın ve paylaşın.', 'दुनिया भर के उभरते और प्रमुख कलाकारों के संगीत के लगातार बढ़ते मिश्रण को खोजें, स्ट्रीम करें और साझा करें।', '发现、流式传输和分享来自世界各地新兴艺术家和主要艺术家的不断扩大的音乐组合。', 'دنیا بھر کے ابھرتے ہوئے اور بڑے فنکاروں کی موسیقی کے مسلسل پھیلتے ہوئے مرکب کو دریافت کریں، سٹریم کریں اور اس کا اشتراک کریں۔', 'Temukan, streaming, dan bagikan campuran musik yang terus berkembang dari artis baru dan artis besar di seluruh dunia.', 'Otkrijte, strujite i dijelite miks glazbe u usponu i velikih umjetnika diljem svijeta koji se stalno širi.', 'גלה, זרם ושתף שילוב מתרחב כל הזמן של מוזיקה מאמנים מתפתחים ואמנים גדולים ברחבי העולם.', 'সারা বিশ্বের উদীয়মান এবং প্রধান শিল্পীদের থেকে একটি ক্রমাগত প্রসারিত সঙ্গীতের মিশ্রণ আবিষ্কার করুন, স্ট্রিম করুন এবং ভাগ করুন৷', '世界中の新進気鋭のアーティストや主要なアーティストの音楽のミックスを常に拡大し、発見、ストリーミング、共有しましょう。', 'ترکیبی از موسیقی در حال گسترش را از هنرمندان نوظهور و بزرگ در سراسر جهان کشف، پخش و به اشتراک بگذارید.', 'Upptäck, streama och dela en ständigt växande mix av musik från framväxande och stora artister runt om i världen.', 'Khám phá, phát trực tuyến và chia sẻ một tổ hợp âm nhạc không ngừng mở rộng từ các nghệ sĩ lớn và mới nổi trên khắp thế giới.', 'Oplev, stream og del en konstant voksende blanding af musik fra nye og store kunstnere over hele verden.', 'Tumuklas, mag-stream, at magbahagi ng patuloy na lumalawak na halo ng musika mula sa mga umuusbong at pangunahing artist sa buong mundo.', '전 세계의 신진 및 주요 아티스트의 지속적으로 확장되는 음악 믹스를 발견, 스트리밍 및 공유하십시오.'),
