(510, '', '', 'lorem_ipsum_dolor_sit_amet__consectetur_adipiscing_elit__sed_do_eiusmod_tempor_incididunt_ut_labore_et_dolore_magna_aliqua.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.', 'Lorem ipsum dolor sit amet، consectetur adipiscing elit، sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.', 'Lorem ipsum dolor sit amet, consectetur elit adipiscing, sed eiusmod tempor incidid ut labore et dolore magna aliqua.', 'Lorem ipsum dolor sitzen amet, consectetur adipiscing elit, sed do eiusmod temporary incididunt ut labore und dolore magna aliqua.', 'Lorem Ipsum Dolor Sit Amet, Concetetur Adipiscing Elit, Sed do EiusMod Tempor Incididunt U Labore et Dolore Magna Aliqua.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.', 'Lorem ipsum dolor amet sitet, adipiscing elit elit, sed do eiusmod tempor inci labunt ve dolore magna aliqua incididunt.', 'रोगी की देखभाल करना महत्वपूर्ण है, डॉक्टर द्वारा उसका पालन किया जाना चाहिए, लेकिन यह बहुत दर्द और पीड़ा का समय है।', '照顾病人很重要，医生要跟进，但这是一个非常痛苦和痛苦的时期。', 'مریض کا خیال رکھنا، ڈاکٹر کی پیروی کرنا ضروری ہے، لیکن یہ وقت بہت تکلیف اور تکلیف کا ہوتا ہے۔', 'Penting untuk merawat pasien, untuk diikuti oleh dokter, tetapi ini adalah saat yang sangat menyakitkan dan menderita.', 'Važno je brinuti se za bolesnika, pratiti ga liječnik, ali to je vrijeme velike boli i patnje.', 'חשוב לדאוג למטופל, להיות בעקבות הרופא, אבל זו תקופה של כאב וסבל רב.', 'রোগীর যত্ন নেওয়া, ডাক্তারের অনুসরণ করা গুরুত্বপূর্ণ, তবে এটি একটি বড় কষ্ট এবং কষ্টের সময়।', '患者の世話をし、医師がフォローすることは重要ですが、それは大きな痛みと苦しみの時です.', 'مراقبت از بیمار، پیگیری پزشک مهم است، اما زمان درد و رنج بسیار است.', 'Det är viktigt att ta hand om patienten, att följas av läkaren, men det är en tid av stor smärta och lidande.', 'Điều quan trọng là phải chăm sóc bệnh nhân, được bác sĩ theo dõi, nhưng đó là khoảng thời gian rất đau đớn và khổ sở.', 'Det er vigtigt at tage sig af patienten, at blive fulgt af lægen, men det er en tid med stor smerte og lidelse.', 'Mahalagang pangalagaan ang pasyente, dapat sundin ng doktor, ngunit ito ay panahon ng matinding sakit at pagdurusa.', '환자를 돌보고 의사가 따라야 하는 것도 중요하지만 큰 고통과 괴로움의 시간입니다.'),
