(530, '', '', 'we___ll_be_back_soon_', 'We’ll be back soon!', 'سنعود قريبا!', 'We zullen snel terug zijn!', 'Nous reviendrons bientôt!', 'Wir werden bald zurück sein!', 'Мы скоро вернемся!', '¡Estaremos de vuelta pronto!', 'Yakında döneceğiz!', 'हम जल्द ही वापस होंगे!', '我们很快就回来！', 'ہم جلد ہی واپس آ جائیں گے!', 'Kami akan segera kembali!', 'Uskoro cemo se vratiti!', 'נחזור בקרוב!', 'আমরা শীঘ্রই ফিরে আসব!', '私たちはすぐ帰るからね！', 'ما به زودی برمی گردیم!', 'Vi kommer snart tillbaka!', 'Chúng tôi sẽ quay lại nhanh thôi!', 'Vi kommer snart tilbage!', 'Babalik kami agad!', '곧 돌아올게요!'),
(531, '', '', 'sorry_for_the_inconvenience_but_we_rsquo_re_performing_some_maintenance_at_the_moment._if_you_need_help_you_can_always', 'Sorry for the inconvenience but we&amp;rsquo;re performing some maintenance at the moment. If you need help you can always', 'نأسف للإزعاج لكننا نقوم ببعض الصيانة في الوقت الحالي. إذا كنت بحاجة إلى مساعدة يمكنك دائما', 'Onze excuses voor het ongemak, maar we voeren momenteel wat onderhoud uit. Als je hulp nodig hebt, kan dat altijd', 'Désolé pour le désagrément occasionné mais nous effectuons actuellement des travaux de maintenance. Si vous avez besoin d\'aide, vous pouvez toujours', 'Wir entschuldigen uns für die Unannehmlichkeiten, aber wir führen momentan einige Wartungsarbeiten durch. Wenn Sie Hilfe brauchen, können Sie das immer tun', 'Приносим извинения за неудобства, но в настоящее время мы проводим техническое обслуживание. Если вам нужна помощь, вы всегда можете', 'Disculpe las molestias, pero estamos realizando algunas tareas de mantenimiento en este momento. Si necesitas ayuda siempre puedes', 'Verdiğimiz rahatsızlıktan dolayı üzgünüz, ancak şu anda bazı bakımlar yapıyoruz. Yardıma ihtiyacınız olursa her zaman', 'असुविधा के लिए खेद है, लेकिन हम इस समय कुछ रखरखाव कर रहे हैं। अगर आपको मदद की ज़रूरत है तो आप हमेशा कर सकते हैं', '很抱歉给您带来不便，但我们目前正在进行一些维护。如果您需要帮助，您可以随时', 'تکلیف کے لیے معذرت لیکن ہم اس وقت کچھ دیکھ بھال کر رہے ہیں۔ اگر آپ کو مدد کی ضرورت ہو تو آپ ہمیشہ کر سکتے ہیں۔', 'Maaf atas ketidaknyamanan ini, tetapi kami sedang melakukan beberapa pemeliharaan saat ini. Jika Anda membutuhkan bantuan, Anda selalu dapat', 'Ispričavamo se zbog neugodnosti, ali trenutačno vršimo određeno održavanje. Ako trebate pomoć uvijek možete', 'סליחה על אי הנוחות אבל אנחנו מבצעים תחזוקה מסוימת כרגע. אם אתה צריך עזרה אתה תמיד יכול', 'অসুবিধার জন্য দুঃখিত কিন্তু আমরা এই মুহূর্তে কিছু রক্ষণাবেক্ষণ করছি। আপনার সাহায্যের প্রয়োজন হলে আপনি সবসময় করতে পারেন', 'ご迷惑をおかけして申し訳ありませんが、現在メンテナンス中です。助けが必要な場合は、いつでもできます', 'با عرض پوزش برای ناراحتی، اما ما در حال حاضر در حال انجام برخی تعمیرات هستیم. اگر به کمک نیاز دارید، همیشه می توانید', 'Vi ber om ursäkt för besväret men vi utför lite underhåll för tillfället. Om du behöver hjälp kan du alltid', 'Xin lỗi vì sự bất tiện này nhưng chúng tôi đang thực hiện một số bảo trì tại thời điểm này. Nếu bạn cần giúp đỡ, bạn luôn có thể', 'Beklager ulejligheden, men vi udfører noget vedligeholdelse i øjeblikket. Hvis du har brug for hjælp, kan du altid', 'Paumanhin para sa abala ngunit nagsasagawa kami ng ilang maintenance sa ngayon. Kung kailangan mo ng tulong maaari mong palaging', '불편을 끼쳐드려 죄송합니다. 현재 일부 유지 보수를 수행하고 있습니다. 도움이 필요하면 언제든지'),
(532, '', '', 'otherwise_we_rsquo_ll_be_back_online_shortly_', 'otherwise we&amp;rsquo;ll be back online shortly!', 'وإلا سنعود إلى الإنترنت قريبًا!', 'anders zijn we binnenkort terug online!', 'sinon, nous serons de nouveau en ligne sous peu!', 'Andernfalls sind wir in Kürze wieder online!', 'в противном случае мы скоро вернемся в онлайн!', 'De lo contrario, estaremos de nuevo en línea próximamente.', 'Aksi halde, kısa süre sonra tekrar çevrimiçi olacağız!', 'अन्यथा हम शीघ्र ही ऑनलाइन वापस आएंगे!', '否则我们很快就会重新上线！', 'بصورت دیگر ہم جلد ہی آن لائن ہوں گے!', 'jika tidak, kami akan segera kembali online!', 'inače ćemo se uskoro vratiti na mrežu!', 'אחרת נחזור לרשת בקרוב!', 'অন্যথায় আমরা শীঘ্রই অনলাইনে ফিরে আসব!', 'それ以外の場合は、まもなくオンラインに戻ります。', 'در غیر این صورت ما به زودی آنلاین خواهیم شد!', 'annars är vi snart online igen!', 'nếu không, chúng tôi sẽ sớm trở lại trực tuyến!', 'ellers er vi snart online igen!', 'kung hindi, babalik kami online sa ilang sandali!', '그렇지 않으면 곧 온라인으로 돌아올 것입니다!');
