(534, '', '', 'otherwise_we_will_be_back_online_shortly_', 'otherwise we will be back online shortly!', 'وإلا فإننا سوف يعود عبر الإنترنت قريبا!', 'anders zijn we binnenkort weer online!', 'sinon nous serons de nouveau en ligne sous peu!', 'Ansonsten sind wir in Kürze wieder online!', 'в противном случае мы вернемся онлайн в ближайшее время!', 'De lo contrario, volveremos a estar en línea pronto.', 'Aksi takdirde kısa süre sonra tekrar çevrimiçi olacağız!', 'अन्यथा हम शीघ्र ही ऑनलाइन वापस आ जाएंगे!', '否则我们很快就会重新上线！', 'بصورت دیگر ہم جلد ہی آن لائن ہوں گے!', 'jika tidak, kami akan segera kembali online!', 'inače ćemo uskoro biti ponovno online!', 'אחרת נחזור לאינטרנט בקרוב!', 'অন্যথায় আমরা শীঘ্রই অনলাইনে ফিরে আসব!', 'それ以外の場合は、まもなくオンラインに戻ります。', 'در غیر این صورت به زودی آنلاین خواهیم شد!', 'annars är vi snart online igen!', 'nếu không, chúng tôi sẽ trở lại trực tuyến trong thời gian ngắn!', 'ellers er vi snart online igen!', 'kung hindi, babalik kami online sa ilang sandali!', '그렇지 않으면 곧 온라인으로 돌아올 것입니다!'),
