(547, '', '', 'thanks_for_your_submission__we_will_review_your_request_shortly.', 'Thanks for your submission, we will review your request shortly.', 'شكرًا على إرسالك ، سنراجع طلبك قريبًا.', 'Bedankt voor uw inzending, we zullen uw verzoek binnenkort beoordelen.', 'Merci pour votre soumission, nous examinerons votre demande sous peu.', 'Vielen Dank für Ihre Eingabe. Wir werden Ihre Anfrage in Kürze prüfen.', 'Спасибо за ваше представление, мы вскоре рассмотрим ваш запрос.', 'Gracias por su envío, revisaremos su solicitud en breve.', 'Gönderdiğiniz için teşekkür ederiz, isteğinizi kısa bir süre sonra gözden geçireceğiz.', 'आपके सबमिशन के लिए धन्यवाद, हम शीघ्र ही आपके अनुरोध की समीक्षा करेंगे।', '感谢您的提交，我们将尽快审核您的请求。', 'آپ کے جمع کرانے کا شکریہ، ہم جلد ہی آپ کی درخواست کا جائزہ لیں گے۔', 'Terima kasih atas kiriman Anda, kami akan segera meninjau permintaan Anda.', 'Zahvaljujemo na vašem podnesku, uskoro ćemo pregledati vaš zahtjev.', 'תודה על הגשתך, אנו נבדוק את בקשתך בקרוב.', 'আপনার জমা দেওয়ার জন্য ধন্যবাদ, আমরা শীঘ্রই আপনার অনুরোধ পর্যালোচনা করব।', 'ご送信いただきありがとうございます。まもなくリクエストを確認いたします。', 'با تشکر از ارسال شما، ما به زودی درخواست شما را بررسی خواهیم کرد.', 'Tack för ditt bidrag, vi kommer att granska din begäran inom kort.', 'Cảm ơn bạn đã gửi, chúng tôi sẽ sớm xem xét yêu cầu của bạn.', 'Tak for din indsendelse, vi vil snart gennemgå din anmodning.', 'Salamat sa iyong pagsusumite, susuriin namin ang iyong kahilingan sa ilang sandali.', '제출해 주셔서 감사합니다. 곧 요청을 검토하겠습니다.'),
