 ঘটে যে প্রচুর কাজ এবং ব্যথা হয়, 2', '第二に、痛み自体は非常に重要です。医師が追跡しますが、多くの仕事と痛みがあるときに起こります.2', 'ثانیاً خود درد بسیار مهم است، توسط پزشک پیگیری می شود، اما در زمانی اتفاق می افتد که کار و درد زیاد است، 2', 'För det andra är smärtan i sig mycket viktig, den kommer att följas av läkaren, men det händer vid en sådan tidpunkt att det är mycket arbete och smärta, 2', 'Hai', 'For det andet er smerten i sig selv meget vigtig, den vil blive fulgt af lægen, men det sker på et sådant tidspunkt, at der er meget arbejde og smerter, 2', 'Pangalawa, ang sakit mismo ay napakahalaga, ito ay susundan ng doktor, ngunit nangyayari ito sa oras na maraming trabaho at sakit, 2', '둘째, 통증 자체가 매우 중요하여 의사가 뒤따르게 되는데, 이때 발생하는 일과 고통이 많다는 점, 2'),
(567, '', '', 'you_can_not_submit_withdrawal_request_until_the_previous_requests_has_been_approved___rejected', 'You can not submit withdrawal request until the previous requests has been approved / rejected', 'لا يمكنك إرسال طلب السحب حتى تتم الموافقة على / رفض الطلبات السابقة', 'U kunt geen opnameverzoek indienen totdat de vorige verzoeken zijn goedgekeurd / afgewezen', 'Vous ne pouvez pas soumettre de demande de retrait avant que les demandes précédentes aient été approuvées / rejetées', 'Sie können eine Auszahlungsanforderung erst absenden, wenn die vorherigen Anforderungen genehmigt / abgelehnt wurden', 'Вы не можете отправить запрос на снятие средств, пока предыдущие запросы не были одобрены / отклонены', 'No puede enviar una solicitud de retiro hasta que las solicitudes anteriores hayan sido aprobadas / rechazadas', 'Önceki istekler onaylanıp reddedilene kadar para çekme isteği gönderemezsiniz.', 'जब तक पिछले अनुरोधों को स्वीकृत/अस्वीकार नहीं किया जाता है तब तक आप निकासी अनुरोध सबमिट नहीं कर सकते हैं', '在之前的请求被批准/拒绝之前，您不能提交提款请求', 'آپ واپسی کی درخواست اس وقت تک جمع نہیں کر سکتے جب تک کہ پچھلی درخواستیں منظور/مسترد نہ ہو جائیں۔', 'Anda tidak dapat mengajukan permintaan penarikan sampai permintaan sebelumnya disetujui/ditolak', 'Ne možete podnijeti zahtjev za povlačenje dok prethodni zahtjevi nisu odobreni/odbijeni', 'אינך יכול להגיש בקשת משיכה עד שהבקשות הקודמות אושרו / נדחו', 'পূর্ববর্তী অনুরোধগুলি অনুমোদিত/প্রত্যাখ্যান না হওয়া পর্যন্ত আপনি প্রত্যাহারের অনুরোধ জমা দিতে পারবেন না', '前のリクエストが承認/拒否されるまで、引き出しリクエストを送信することはできません', 'شما نمی توانید درخواست انصراف را تا زمانی که درخواست های قبلی تایید / رد شده است ارسال کنید', 'Du kan inte skicka en begäran om uttag förrän de tidigare begäranden har godkänts/avvisats', 'Bạn không thể gửi yêu cầu rút tiền cho đến khi các yêu cầu trước đó đã được chấp thuận / từ chối', 'Du kan ikke indsende en fortrydelsesanmodning, før de tidligere anmodninger er blevet godkendt/afvist', 'Hindi ka maaaring magsumite ng kahilingan sa pag-withdraw hanggang ang mga nakaraang kahilingan ay naaprubahan / tinanggihan', '이전 요청이 승인/거절될 때까지 출금 요청을 제출할 수 없습니다.'),
(568, '', '', 'get_verified__get_a_special_looking_profile_and_get_famous_on_our_platform_', 'Get verified, get a special looking profile and get famous on our platform!', 'الحصول على التحقق ، والحصول على ملف تعريف خاص المظهر والحصول على شهرة على منصة لدينا!', 'Word geverifieerd, krijg een speciaal uitziend profiel en word beroemd op ons platform!', 'Faites-vous vérifier, obtenez un profil spécial et devenez célèbre sur notre plateforme!', 'Lassen Sie sich verifizieren, erhalten Sie ein besonderes Profil und werden Sie auf unserer Plattform berühmt!', 'Пройдите проверку, получите специальный профиль и станьте известным на нашей платформе!', '¡Verifíquese, obtenga un perfil especial y vuélvase famoso en nuestra plataforma!', 'Doğrulayın, özel bir görünüme sahip olun ve platformumuzda ünlü olun!', 'सत्यापित हो जाओ, एक विशेष दिखने वाली प्रोफ़ाइल प्राप्त करें और हमारे मंच पर प्रसिद्ध हो जाएं!', '获得验证，获得特别的个人资料，并在我们的平台上出名！', 'تصدیق حاصل کریں، ایک خاص نظر آنے والا پروفائل حاصل کریں اور ہمارے پلیٹ فارم پر مشہور ہو جائیں!', 'Dapatkan verifikasi, dapatkan profil yang tampak istimewa, dan jadilah terkenal di platform kami!', 'Potvrdite se, nabavite profil posebnog izgleda i proslavite se na našoj platformi!', 'קבל אימות, קבל פרופיל בעל מראה מיוחד והתפרסם בפלטפורמה שלנו!', 'যাচাই করুন, একটি বিশেষ লুকিং প্রোফাইল পান এবং আমাদের প্ল্যাটফর্মে বিখ্যাত হন!', '認証を受けて、特別なプロフィールを手に入れて、私たちのプラットフォームで有名になりましょう!', 'تأیید شوید، نمایه ای خاص به دست آورید و در پلت فرم ما مشهور شوید!', 'Bli verifierad, få en speciell profil och bli känd på vår plattform!', 'Được xác minh, có được một hồ sơ đặc biệt và trở nên nổi tiếng trên nền tảng của chúng tôi!', 'Bliv verificeret, få en speciel udseende profil og bliv berømt på vores platform!', 'Magpa-verify, makakuha ng isang espesyal na naghahanap ng profile at sumikat sa aming platform!', '인증을 받고 특별해 보이는 프로필을 얻고 우리 플랫폼에서 유명해집니다!'),
