(582, '', '', 'we_have_rejected_your_bank_transfer__please_contact_us_for_more_details.', 'We have rejected your bank transfer, please contact us for more details.', 'لقد رفضنا تحويلك المصرفي ، يرجى الاتصال بنا للحصول على مزيد من التفاصيل.', 'We hebben uw overboeking geweigerd. Neem contact met ons op voor meer informatie.', 'Nous avons refusé votre virement bancaire, veuillez nous contacter pour plus de détails.', 'Wir haben Ihre Überweisung abgelehnt. Bitte kontaktieren Sie uns für weitere Informationen.', 'Мы отклонили ваш банковский перевод, пожалуйста, свяжитесь с нами для получения более подробной информации.', 'Hemos rechazado su transferencia bancaria, póngase en contacto con nosotros para obtener más detalles.', 'Banka havalenizi reddettik, daha fazla bilgi için lütfen bizimle iletişime geçin.', 'हमने आपका बैंक हस्तांतरण अस्वीकार कर दिया है, अधिक जानकारी के लिए कृपया हमसे संपर्क करें।', '我们已拒绝您的银行转帐，请联系我们了解更多详情。', 'ہم نے آپ کی بینک ٹرانسفر کو مسترد کر دیا ہے، مزید تفصیلات کے لیے براہ کرم ہم سے رابطہ کریں۔', 'Kami telah menolak transfer bank Anda, silakan hubungi kami untuk detail lebih lanjut.', 'Odbili smo vaš bankovni prijenos, obratite nam se za više detalja.', 'דחינו את ההעברה הבנקאית שלך, אנא צור איתנו קשר לפרטים נוספים.', 'আমরা আপনার ব্যাঙ্ক ট্রান্সফার প্রত্যাখ্যান করেছি, আরও বিস্তারিত জানার জন্য আমাদের সাথে যোগাযোগ করুন।', '銀行振込を拒否しました。詳細についてはお問い合わせください。', 'ما حواله بانکی شما را رد کردیم، لطفاً برای جزئیات بیشتر با ما تماس بگیرید.', 'Vi har avvisat din banköverföring, kontakta oss för mer information.', 'Chúng tôi đã từ chối chuyển khoản ngân hàng của bạn, vui lòng liên hệ với chúng tôi để biết thêm chi tiết.', 'Vi har afvist din bankoverførsel, kontakt os venligst for flere detaljer.', 'Tinanggihan namin ang iyong bank transfer, mangyaring makipag-ugnayan sa amin para sa higit pang mga detalye.', '은행 송금이 거부되었습니다. 자세한 내용은 문의해 주십시오.'),
