(642, '', '', 'you_have_reached_your_upload_limit__upgrade_to_upload_unlimited_songs.', 'You have reached your upload limit, upgrade to upload unlimited songs.', 'لقد وصلت إلى الحد الأقصى للتحميل ، قم بالترقية لتحميل الأغاني غير المحدودة.', 'Je hebt je uploadlimiet bereikt, upgrade om onbeperkte nummers te uploaden.', 'Vous avez atteint votre limite de téléchargement, effectuez une mise à niveau pour télécharger des morceaux illimités.', 'Sie haben Ihr Upload-Limit erreicht. Aktualisieren Sie, um unbegrenzt viele Songs hochzuladen.', 'Вы достигли предела загрузки, обновите, чтобы загрузить неограниченное количество песен.', 'Ha alcanzado su límite de carga, actualice para cargar canciones ilimitadas.', 'Yükleme sınırınıza ulaştınız, sınırsız şarkı yüklemek için yükseltme yapın.', 'आप अपनी अपलोड सीमा तक पहुंच गए हैं, असीमित गाने अपलोड करने के लिए अपग्रेड करें।', '您已达到上传限制，请升级以上传无限歌曲。', 'آپ اپنی اپ لوڈ کی حد تک پہنچ گئے ہیں، لامحدود گانے اپ لوڈ کرنے کے لیے اپ گریڈ کریں۔', 'Anda telah mencapai batas unggahan Anda, tingkatkan untuk mengunggah lagu tanpa batas.', 'Dosegli ste ograničenje prijenosa, nadogradite za prijenos neograničenog broja pjesama.', 'הגעת למגבלת ההעלאה שלך, שדרג להעלאת שירים ללא הגבלה.', 'আপনি আপনার আপলোড সীমায় পৌঁছেছেন, সীমাহীন গান আপলোড করতে আপগ্রেড করুন৷', 'アップロード制限に達しました。無制限の曲をアップロードするには、アップグレードしてください。', 'به حد مجاز آپلود خود رسیده اید، برای آپلود نامحدود آهنگ ارتقا دهید.', 'Du har nått din uppladdningsgräns, uppgradera för att ladda upp obegränsat antal låtar.', 'Bạn đã đạt đến giới hạn tải lên của mình, hãy nâng cấp để tải lên các bài hát không giới hạn.', 'Du har nået din uploadgrænse, opgrader for at uploade ubegrænset sange.', 'Naabot mo na ang iyong limitasyon sa pag-upload, mag-upgrade para mag-upload ng walang limitasyong mga kanta.', '업로드 한도에 도달했습니다. 노래를 무제한으로 업로드하려면 업그레이드하세요.'),
