(701, '', '', 'error_found_while_importing_your_track__please_try_again_later.', 'Error found while importing your track, please try again later.', 'تم العثور على خطأ أثناء استيراد المسار ، يرجى المحاولة مرة أخرى لاحقًا.', 'Er is een fout gevonden tijdens het importeren van uw track. Probeer het later opnieuw.', 'Erreur détectée lors de l\'importation de votre piste, veuillez réessayer ultérieurement.', 'Beim Importieren Ihres Tracks ist ein Fehler aufgetreten. Bitte versuchen Sie es später erneut.', 'При импорте трека обнаружена ошибка. Повторите попытку позже.', 'Se encontró un error al importar su pista. Vuelva a intentarlo más tarde.', 'Parça içe aktarılırken hata bulundu, lütfen daha sonra tekrar deneyin.', 'आपका ट्रैक आयात करते समय त्रुटि मिली, कृपया बाद में पुन: प्रयास करें।', '导入曲目时发现错误，请稍后重试。', 'آپ کا ٹریک درآمد کرتے وقت خرابی پائی گئی، براہ کرم بعد میں دوبارہ کوشش کریں۔', 'Kesalahan ditemukan saat mengimpor trek Anda, coba lagi nanti.', 'Pronađena je pogreška prilikom uvoza vaše staze, pokušajte ponovno kasnije.', 'נמצאה שגיאה בעת ייבוא הרצועה שלך, אנא נסה שוב מאוחר יותר.', 'আপনার ট্র্যাক আমদানি করার সময় ত্রুটি পাওয়া গেছে, অনুগ্রহ করে পরে আবার চেষ্টা করুন।', 'トラックのインポート中にエラーが見つかりました。後でもう一度お試しください。', 'هنگام وارد کردن آهنگ شما خطایی پیدا شد، لطفاً بعداً دوباره امتحان کنید.', 'Ett fel hittades vid import av ditt spår, försök igen senare.', 'Đã tìm thấy lỗi khi nhập tuyến đường của bạn, vui lòng thử lại sau.', 'Der blev fundet en fejl under import af dit nummer. Prøv venligst igen senere.', 'May nakitang error habang ini-import ang iyong track, pakisubukang muli sa ibang pagkakataon.', '트랙을 가져오는 동안 오류가 발견되었습니다. 나중에 다시 시도해 주세요.'),
(702, '', '', 'please_enter_valid_soundcloud_track_url.', 'Please enter a valid SoundCloud track URL.', 'يرجى إدخال عنوان URL صالح لبرنامج SoundCloud.', 'Voer een geldige SoundCloud-track-URL in.', 'Veuillez entrer une URL de piste SoundCloud valide.', 'Bitte geben Sie eine gültige SoundCloud-Track-URL ein.', 'Пожалуйста, введите действительный URL трека SoundCloud.', 'Ingrese una URL de pista válida de SoundCloud.', 'Lütfen geçerli bir SoundCloud parça URL\'si girin.', 'कृपया एक मान्य साउंडक्लाउड ट्रैक URL दर्ज करें।', '请输入有效的 SoundCloud 曲目 URL。', 'براہ کرم ایک درست SoundCloud ٹریک URL درج کریں۔', 'Masukkan URL trek SoundCloud yang valid.', 'Unesite važeći URL SoundCloud zapisa.', 'אנא הזן כתובת אתר חוקית של רצועת SoundCloud.', 'দয়া করে একটি বৈধ SoundCloud ট্র্যাক URL লিখুন৷', '有効な SoundCloud トラック URL を入力してください。', 'لطفاً یک URL آهنگ معتبر SoundCloud وارد کنید.', 'Ange en giltig URL för SoundCloud-spår.', 'Vui lòng nhập URL theo dõi SoundCloud hợp lệ.', 'Indtast venligst en gyldig URL for SoundCloud-spor.', 'Mangyaring maglagay ng wastong SoundCloud track URL.', '유효한 SoundCloud 트랙 URL을 입력하십시오.'),
