(738, '', '', 'your_session_has_been_expired__please_login_again.', 'Your Session has been expired, please login again.', 'انتهت جلستك ، يرجى تسجيل الدخول مرة أخرى.', 'Uw sessie is verlopen, log opnieuw in.', 'Votre session a expiré, veuillez vous reconnecter.', 'Ihre Sitzung ist abgelaufen, bitte melden Sie sich erneut an.', 'Ваша сессия истекла, пожалуйста, войдите снова.', 'Su sesión ha caducado, vuelva a iniciar sesión.', 'Oturumunuzun süresi doldu, lütfen tekrar giriş yapın.', 'आपका सत्र समाप्त हो गया है, कृपया फिर से लॉगिन करें।', '您的会话已过期，请重新登录。', 'آپ کے سیشن کی میعاد ختم ہو چکی ہے، براہ کرم دوبارہ لاگ ان کریں۔', 'Sesi Anda telah kedaluwarsa, silakan login kembali.', 'Vaša je sesija istekla, prijavite se ponovno.', 'פג תוקף ההפעלה שלך, אנא התחבר שוב.', 'আপনার সেশনের মেয়াদ শেষ হয়ে গেছে, অনুগ্রহ করে আবার লগইন করুন।', 'セッションの有効期限が切れています。もう一度ログインしてください。', 'جلسه شما منقضی شده است، لطفا دوباره وارد شوید.', 'Din session har löpt ut, vänligen logga in igen.', 'Phiên của bạn đã hết hạn, vui lòng đăng nhập lại.', 'Din session er udløbet, log venligst ind igen.', 'Ang iyong Session ay nag-expire na, mangyaring mag-login muli.', '세션이 만료되었습니다. 다시 로그인하십시오.'),
