(743, '', '', 'turn_on_2-step_login_to_level-up_your_account_s_security__once_turned_on__you_ll_use_both_your_password_and_a_6-digit_security_code_sent_to_your_phone_or_email_to_log_in.', 'Turn on 2-step login to level-up your account\'s security, Once turned on, you\'ll use both your password and a 6-digit security code sent to your phone or email to log in.', 'قم بتشغيل تسجيل الدخول من خطوتين لتحسين مستوى حسابك', 'Schakel inloggen in twee stappen in om uw account een hoger niveau te geven', 'Activez la connexion en deux étapes pour mettre votre compte à niveau.', 'Aktivieren Sie die zweistufige Anmeldung, um Ihr Konto aufzustocken', 'Включите двухэтапный вход, чтобы повысить уровень своей учетной записи', 'Active el inicio de sesión en 2 pasos para subir de nivel su cuenta', 'Hesabınızı seviyelendirmek için 2 adımlı girişi açın', 'अपने खाते की सुरक्षा को स्तर-अप करने के लिए 2-चरणीय लॉगिन चालू करें, एक बार चालू होने पर, आप लॉग इन करने के लिए अपने पासवर्ड और अपने फ़ोन या ईमेल पर भेजे गए 6-अंकीय सुरक्षा कोड दोनों का उपयोग करेंगे।', '打开两步登录以提高您帐户的安全性，一旦打开，您将使用您的密码和发送到您的手机或电子邮件的 6 位数安全码进行登录。', 'اپنے اکاؤنٹ کی سیکیورٹی کو لیول کرنے کے لیے 2 قدمی لاگ ان کو آن کریں، ایک بار آن ہونے کے بعد، آپ لاگ ان کرنے کے لیے اپنے فون یا ای میل پر بھیجے گئے اپنا پاس ورڈ اور 6 ہندسوں کا سیکیورٹی کوڈ دونوں استعمال کریں گے۔', 'Aktifkan login 2 langkah untuk meningkatkan keamanan akun Anda, Setelah diaktifkan, Anda akan menggunakan kata sandi dan kode keamanan 6 digit yang dikirim ke ponsel atau email Anda untuk login.', 'Uključite prijavu u 2 koraka kako biste podigli razinu sigurnosti svog računa. Kada je uključite, za prijavu ćete koristiti i svoju lozinku i 6-znamenkasti sigurnosni kod poslan na vaš telefon ili e-poštu.', 'הפעל התחברות דו-שלבית כדי לשפר את האבטחה של חשבונך. לאחר ההפעלה, תשתמש גם בסיסמה וגם בקוד אבטחה בן 6 ספרות שנשלח לטלפון או לאימייל כדי להיכנס.', 'আপনার অ্যাকাউন্টের নিরাপত্তার স্তর বাড়াতে 2-পদক্ষেপ লগইন চালু করুন, একবার চালু হলে, আপনি লগ ইন করতে আপনার ফোন বা ইমেলে পাঠানো আপনার পাসওয়ার্ড এবং একটি 6-সংখ্যার নিরাপত্তা কোড উভয়ই ব্যবহার করবেন।', '2 段階ログインを有効にして、アカウントのセキュリティをレベルアップします。有効にすると、パスワードと、電話または電子メールに送信された 6 桁のセキュリティ コードの両方を使用してログインします。', 'برای ارتقای امنیت حساب خود، ورود دو مرحله ای را روشن کنید، پس از روشن شدن، از رمز عبور و کد امنیتی 6 رقمی ارسال شده به تلفن یا ایمیل خود برای ورود به سیستم استفاده می کنید.', 'Aktivera 2-stegsinloggning för att höja säkerheten på ditt konto. När du har aktiverat det använder du både ditt lösenord och en 6-siffrig säkerhetskod som skickas till din telefon eller e-post för att logga in.', 'Bật đăng nhập 2 bước để tăng cường bảo mật cho tài khoản của bạn, Sau khi được bật, bạn sẽ sử dụng cả mật khẩu và mã bảo mật gồm 6 chữ số được gửi đến điện thoại hoặc email của bạn để đăng nhập.', 'Slå 2-trins login til for at øge din kontos sikkerhed. Når den er aktiveret, bruger du både din adgangskode og en 6-cifret sikkerhedskode sendt til din telefon eller e-mail til at logge ind.', 'I-on ang 2-step na pag-log in upang i-level-up ang seguridad ng iyong account, Kapag na-on, gagamitin mo pareho ang iyong password at isang 6-digit na security code na ipinadala sa iyong telepono o email upang mag-log in.', '2단계 로그인을 켜면 계정 보안 수준이 높아집니다. 일단 켜면 비밀번호와 휴대전화나 이메일로 전송된 6자리 보안 코드를 모두 사용하여 로그인합니다.'),
(744, '', '', 'a_confirmation_email_has_been_sent.', 'A confirmation email has been sent.', 'تم إرسال رسالة تأكيد بالبريد الإلكتروني.', 'Er is een bevestigingsmail verzonden.', 'Un email de confirmation a été envoyé.', 'Eine Bestätigungs-E-Mail wurde gesendet.', 'Письмо с подтверждением было отправлено.', 'Un correo electrónico de confirmación ha sido enviado.', 'Bir onay e-postası gönderildi.', 'एक पुष्टिकरण ईमेल भेजा गया है।', '已发送确认电子邮件。', 'ایک تصدیقی ای میل بھیجا گیا ہے۔', 'Email konfirmasi telah dikirim.', 'E-pošta potvrde je poslana.', 'דוא&quot;ל אישור נשלח.', 'একটি নিশ্চিতকরণ ইমেল পাঠানো হয়েছে.', '確認メールを送信しました。', 'یک ایمیل تایید ارسال شده است.', 'Ett bekräftelsemail har skickats.', 'Một email xác nhận đã được gửi.', 'En bekræftelsesmail er blevet sendt.', 'Isang email ng kumpirmasyon ang naipadala.', '확인 이메일이 전송되었습니다.'),
