(773, '', '', 'you_can_not_import_this_track_because_this_track_is_one_of_soundcloud_go__tracks.', 'You can not import this track because this track is one of SoundCloud Go+ tracks.', 'لا يمكنك استيراد هذا المسار لأن هذا المسار هو أحد مسارات SoundCloud Go.', 'Je kunt deze track niet importeren omdat deze een van SoundCloud Go-tracks is.', 'Vous ne pouvez pas importer cette piste car cette piste est l\'une des pistes SoundCloud Go.', 'Sie können diese Spur nicht importieren, da es sich bei dieser Spur um eine SoundCloud Go-Spur handelt.', 'Вы не можете импортировать этот трек, потому что этот трек является одним из треков SoundCloud Go.', 'No puede importar esta pista porque esta es una de las pistas de SoundCloud Go.', 'Bu parçayı içe aktaramazsınız çünkü bu parça SoundCloud Go parçalarından biridir.', 'आप इस ट्रैक को आयात नहीं कर सकते क्योंकि यह ट्रैक साउंडक्लाउड गो+ ट्रैक में से एक है।', '您无法导入此曲目，因为此曲目是 SoundCloud Go+ 曲目之一。', 'آپ اس ٹریک کو درآمد نہیں کر سکتے کیونکہ یہ ٹریک SoundCloud Go+ ٹریکس میں سے ایک ہے۔', 'Anda tidak dapat mengimpor trek ini karena trek ini adalah salah satu trek SoundCloud Go+.', 'Ne možete uvesti ovaj zapis jer je ovaj zapis jedan od SoundCloud Go+ zapisa.', 'לא ניתן לייבא את הרצועה הזו מכיוון שהרצועה הזו היא אחת מרצועות SoundCloud Go+.', 'আপনি এই ট্র্যাকটি আমদানি করতে পারবেন না কারণ এই ট্র্যাকটি SoundCloud Go+ ট্র্যাকের মধ্যে একটি৷', 'このトラックは SoundCloud Go+ トラックの 1 つであるため、インポートできません。', 'نمی‌توانید این آهنگ را وارد کنید زیرا این آهنگ یکی از آهنگ‌های SoundCloud Go+ است.', 'Du kan inte importera det här spåret eftersom det här spåret är ett av SoundCloud Go+-spår.', 'Bạn không thể nhập bản nhạc này vì bản nhạc này là một trong các bản nhạc của SoundCloud Go +.', 'Du kan ikke importere dette spor, fordi dette spor er et af SoundCloud Go+-numrene.', 'Hindi mo ma-import ang track na ito dahil ang track na ito ay isa sa mga track ng SoundCloud Go+.', '이 트랙은 SoundCloud Go+ 트랙 중 하나이므로 가져올 수 없습니다.'),
