(841, '', '', 'you_can_earn_points_and_transfer_them_to_your_wallet_by_doing_the_activities_below.', 'You can earn points and transfer them to your wallet by doing the activities below.', 'يمكنك كسب النقاط وتحويلها إلى محفظتك من خلال القيام بالأنشطة أدناه.', 'U kunt punten verdienen en deze overboeken naar uw portemonnee door de onderstaande activiteiten uit te voeren.', 'Vous pouvez gagner des points et les transférer dans votre portefeuille en effectuant les activités ci-dessous.', 'Sie können Punkte sammeln und diese in Ihre Brieftasche übertragen, indem Sie die folgenden Aktivitäten ausführen.', 'Вы можете зарабатывать баллы и переводить их в свой кошелек, выполняя указанные ниже действия.', 'Puede ganar puntos y transferirlos a su billetera realizando las siguientes actividades.', 'Aşağıdaki aktiviteleri yaparak puan kazanabilir ve cüzdanınıza aktarabilirsiniz.', 'आप नीचे दी गई गतिविधियों को करके अंक अर्जित कर सकते हैं और उन्हें अपने वॉलेट में स्थानांतरित कर सकते हैं।', '您可以通过以下活动赚取积分并将其转入您的钱包。', 'آپ نیچے دی گئی سرگرمیاں کر کے پوائنٹس حاصل کر سکتے ہیں اور انہیں اپنے بٹوے میں منتقل کر سکتے ہیں۔', 'Anda dapat memperoleh poin dan mentransfernya ke dompet Anda dengan melakukan aktivitas di bawah ini.', 'Možete zaraditi bodove i prebaciti ih u svoj novčanik obavljanjem aktivnosti u nastavku.', 'אתה יכול לצבור נקודות ולהעביר אותן לארנק שלך על ידי ביצוע הפעילויות שלהלן.', 'আপনি পয়েন্ট অর্জন করতে পারেন এবং নীচের কার্যকলাপগুলি করে আপনার ওয়ালেটে স্থানান্তর করতে পারেন৷', '以下のアクティビティを実行することで、ポイントを獲得してウォレットに転送できます。', 'با انجام فعالیت های زیر می توانید امتیاز کسب کرده و به کیف پول خود منتقل کنید.', 'Du kan tjäna poäng och överföra dem till din plånbok genom att göra aktiviteterna nedan.', 'Bạn có thể kiếm điểm và chuyển chúng vào ví của mình bằng cách thực hiện các hoạt động bên dưới.', 'Du kan optjene point og overføre dem til din tegnebog ved at udføre aktiviteterne nedenfor.', 'Maaari kang makakuha ng mga puntos at ilipat ang mga ito sa iyong wallet sa pamamagitan ng paggawa ng mga aktibidad sa ibaba.', '아래 활동을 통해 포인트를 적립하고 지갑으로 이체할 수 있습니다.'),
(842, '', '', 'login_or_register_to_start_earning_points_', 'Login or Register to start earning points!', 'تسجيل الدخول أو التسجيل لبدء كسب النقاط!', 'Log in of registreer om punten te verdienen!', 'Connectez-vous ou inscrivez-vous pour commencer à gagner des points!', 'Melden Sie sich an oder registrieren Sie sich, um Punkte zu sammeln!', 'Войдите или зарегистрируйтесь, чтобы начать зарабатывать очки!', '¡Inicie sesión o regístrese para comenzar a ganar puntos!', 'Puan kazanmaya başlamak için Giriş Yapın veya Kaydolun!', 'अंक अर्जित करने के लिए लॉगिन या रजिस्टर करें!', '登录或注册开始赚取积分！', 'پوائنٹس حاصل کرنا شروع کرنے کے لیے لاگ ان کریں یا رجسٹر کریں!', 'Masuk atau Daftar untuk mulai mendapatkan poin!', 'Prijavite se ili se registrirajte kako biste počeli zarađivati bodove!', 'התחבר או הירשם כדי להתחיל לצבור נקודות!', 'লগইন বা নিবন্ধন পয়েন্ট উপার্জন শুরু!', 'ログインまたは登録してポイントを獲得しましょう！', 'برای شروع کسب امتیاز وارد شوید یا ثبت نام کنید!', 'Logga in eller registrera dig för att börja tjäna poäng!', 'Đăng nhập hoặc Đăng ký để bắt đầu kiếm điểm!', 'Log ind eller tilmeld dig for at begynde at optjene point!', 'Mag-login o Magrehistro para magsimulang kumita ng mga puntos!', '로그인 또는 등록하여 포인트 적립을 시작하세요!'),
