(844, '', '', '_your_address_has_been_added_successfully_', 'Your address has been added successfully!', 'تم إضافة عنوانك بنجاح!', 'Uw adres is succesvol toegevoegd!', 'Votre adresse a été ajoutée avec succès!', 'Ihre Adresse wurde erfolgreich hinzugefügt!', 'Ваш адрес был успешно добавлен!', '¡Su dirección se ha agregado con éxito!', 'Adresiniz başarıyla eklendi!', 'आपका पता सफलतापूर्वक जोड़ दिया गया है!', '您的地址已添加成功！', 'آپ کا پتہ کامیابی کے ساتھ شامل کر دیا گیا ہے!', 'Alamat Anda telah berhasil ditambahkan!', 'Vaša adresa je uspješno dodana!', 'הכתובת שלך נוספה בהצלחה!', 'আপনার ঠিকানা সফলভাবে যোগ করা হয়েছে!', 'あなたのアドレスは正常に追加されました!', 'آدرس شما با موفقیت اضافه شد!', 'Din adress har lagts till!', 'Địa chỉ của bạn đã được thêm thành công!', 'Din adresse er blevet tilføjet!', 'Ang iyong address ay matagumpay na naidagdag!', '주소가 성공적으로 추가되었습니다!'),
(845, '', '', '_your_address_has_been_edited_successfully_', 'Your address has been edited successfully!', 'تم تحرير عنوانك بنجاح!', 'Uw adres is succesvol bewerkt!', 'Votre adresse a été modifiée avec succès!', 'Ihre Adresse wurde erfolgreich bearbeitet!', 'Ваш адрес был успешно отредактирован!', '¡Su dirección ha sido editada con éxito!', 'Adresiniz başarıyla düzenlendi!', 'आपका पता सफलतापूर्वक संपादित कर दिया गया है!', '您的地址已成功编辑！', 'آپ کا پتہ کامیابی کے ساتھ ترمیم کر دیا گیا ہے!', 'Alamat Anda telah berhasil diedit!', 'Vaša adresa je uspješno uređena!', 'הכתובת שלך נערכה בהצלחה!', 'আপনার ঠিকানা সফলভাবে সম্পাদনা করা হয়েছে!', 'あなたの住所は正常に編集されました。', 'آدرس شما با موفقیت ویرایش شد!', 'Din adress har redigerats framgångsrikt!', 'Địa chỉ của bạn đã được chỉnh sửa thành công!', 'Din adresse er blevet redigeret!', 'Matagumpay na na-edit ang iyong address!', '주소가 성공적으로 수정되었습니다!'),
(846, '', '', '_name_must_be_between_5_32_', 'Name must be between 5/32', 'يجب أن يكون الاسم بين 5/32', 'Naam moet tussen 5/32 zijn', 'Le nom doit être compris entre 5/32', 'Der Name muss zwischen 5/32 liegen', 'Имя должно быть между 5/32', 'El nombre debe estar entre 5/32', 'ADI 5/32 arasında olmalıdır', 'नाम 5/32 . के बीच होना चाहिए', '名称必须在 5/32 之间', 'نام 5/32 کے درمیان ہونا چاہیے۔', 'Nama harus antara 5/32', 'Naziv mora biti između 5/32', 'השם חייב להיות בין 5/32', 'নাম হতে হবে 5/32 এর মধ্যে', '名前は 5/32 の間でなければなりません', 'نام باید بین 5/32 باشد', 'Namnet måste vara mellan 32/5', 'Tên phải nằm trong khoảng 5/32', 'Navnet skal være mellem 5/32', 'Ang pangalan ay dapat nasa pagitan ng 5/32', '이름은 5/32 사이여야 합니다.'),
(847, '', '', '_the_url_is_invalid._please_enter_a_valid_url_', 'The URL is invalid, Please enter a valid URL.', 'عنوان URL غير صالح، يرجى إدخال عنوان URL صالح.', 'De URL is ongeldig, voer een geldige URL in.', 'L\'URL n\'est pas valide, veuillez entrer une URL valide.', 'Die URL ist ungültig, bitte geben Sie eine gültige URL ein.', 'URL-адрес недействителен, введите действительный URL.', 'La URL no es válida, ingrese una URL válida.', 'URL geçersiz, lütfen geçerli bir URL girin.', 'URL अमान्य है, कृपया एक मान्य URL दर्ज करें।', 'URL 无效，请输入有效的 URL。', 'URL غلط ہے، براہ کرم ایک درست URL درج کریں۔', 'URL tidak valid, Harap masukkan URL yang valid.', 'URL je nevažeći, unesite važeći URL.', 'כתובת האתר אינה חוקית, אנא הזן כתובת אתר חוקית.', 'URLটি অবৈধ, অনুগ্রহ করে একটি বৈধ URL লিখুন৷', 'URL が無効です。有効な URL を入力してください。', 'URL نامعتبر است، لطفاً یک URL معتبر وارد کنید.', 'URL:en är ogiltig. Ange en giltig URL.', 'URL không hợp lệ, Vui lòng nhập một URL hợp lệ.', 'URL&#39;en er ugyldig. Indtast venligst en gyldig URL.', 'Ang URL ay hindi wasto, Mangyaring magpasok ng wastong URL.', 'URL이 잘못되었습니다. 올바른 URL을 입력하십시오.'),
(848, '', '', '_media_file_is_invalid._please_select_a_valid_image___video_', 'Media file is invalid, Please select a valid image / video.', 'ملف الوسائط غير صالح، يرجى تحديد صورة صالحة / فيديو صالحة.', 'Mediabestand is ongeldig, selecteer een geldige afbeelding / video.', 'Le fichier multimédia n\'est pas valide, sélectionnez une image / vidéo valide.', 'Die Mediendatei ist ungültig, bitte wählen Sie ein gültiges Bild / Video aus.', 'Медиа-файл недействителен, выберите действительное изображение / видео.', 'El archivo multimedia no es válido, seleccione una imagen / video válida.', 'Medya dosyası geçersiz, lütfen geçerli bir resim / video seçin.', 'मीडिया फ़ाइल अमान्य है, कृपया एक मान्य छवि / वीडियो चुनें।', '媒体文件无效，请选择有效的图片/视频。', 'میڈیا فائل غلط ہے، براہ کرم ایک درست تصویر/ویڈیو منتخب کریں۔', 'File media tidak valid, Harap pilih gambar/video yang valid.', 'Medijska datoteka nije valjana, odaberite valjanu sliku/video.', 'קובץ המדיה לא חוקי, אנא בחר תמונה/סרטון חוקיים.', 'মিডিয়া ফাইলটি অবৈধ, দয়া করে একটি বৈধ ছবি/ভিডিও নির্বাচন করুন৷', 'メディア ファイルが無効です。有効な画像/動画を選択してください。', 'فایل رسانه نامعتبر است، لطفاً یک تصویر / ویدیوی معتبر انتخاب کنید.', 'Mediafilen är ogiltig. Välj en giltig bild/video.', 'Tệp phương tiện không hợp lệ, Vui lòng chọn hình ảnh / video hợp lệ.', 'Mediefilen er ugyldig. Vælg venligst et gyldigt billede/video.', 'Ang media file ay hindi wasto, Mangyaring pumili ng wastong larawan / video.', '미디어 파일이 잘못되었습니다. 올바른 이미지/동영상을 선택하세요.'),
