(863, '', '', '_your_product_is_under_review_', 'Your product is submitted and will be reviewed soon.', 'يتم تقديم منتجك وسيتم مراجعته قريبا.', 'Uw product wordt ingediend en wordt binnenkort beoordeeld.', 'Votre produit est soumis et sera revu bientôt.', 'Ihr Produkt wird eingereicht und wird bald überprüft.', 'Ваш продукт отправлен и будет рассмотрен в ближайшее время.', 'Su producto se envía y será revisado pronto.', 'Ürününüz gönderilir ve yakında gözden geçirilecektir.', 'आपका उत्पाद सबमिट कर दिया गया है और जल्द ही इसकी समीक्षा की जाएगी.', '您的产品已提交，将很快进行审核。', 'آپ کا پروڈکٹ جمع کر دیا گیا ہے اور جلد ہی اس کا جائزہ لیا جائے گا۔', 'Produk Anda telah dikirim dan akan segera ditinjau.', 'Vaš proizvod je poslan i uskoro će biti pregledan.', 'המוצר שלך נשלח וייבדק בקרוב.', 'আপনার পণ্য জমা দেওয়া হয়েছে এবং শীঘ্রই পর্যালোচনা করা হবে.', '商品が送信され、すぐに審査されます。', 'محصول شما ارسال شد و به زودی بررسی خواهد شد.', 'Din produkt har skickats in och kommer att granskas snart.', 'Sản phẩm của bạn đã được gửi và sẽ sớm được xem xét.', 'Dit produkt er indsendt og vil snart blive gennemgået.', 'Ang iyong produkto ay isinumite at susuriin sa lalong madaling panahon.', '귀하의 제품이 제출되었으며 곧 검토될 것입니다.'),
(864, '', '', '_your_product_has_been_edited_successfully_', 'Your product has been edited successfully!', 'تم تحرير منتجك بنجاح!', 'Uw product is succesvol bewerkt!', 'Votre produit a été édité avec succès!', 'Ihr Produkt wurde erfolgreich bearbeitet!', 'Ваш продукт был успешно отредактирован!', '¡Su producto ha sido editado con éxito!', 'Ürününüz başarıyla düzenlendi!', 'आपका उत्पाद सफलतापूर्वक संपादित किया गया है!', '您的产品已编辑成功！', 'آپ کے پروڈکٹ میں کامیابی کے ساتھ ترمیم کی گئی ہے!', 'Produk Anda telah berhasil diedit!', 'Vaš proizvod je uspješno uređen!', 'המוצר שלך נערך בהצלחה!', 'আপনার পণ্য সফলভাবে সম্পাদনা করা হয়েছে!', 'あなたの製品は正常に編集されました!', 'محصول شما با موفقیت ویرایش شد!', 'Din produkt har redigerats framgångsrikt!', 'Sản phẩm của bạn đã được chỉnh sửa thành công!', 'Dit produkt er blevet redigeret med succes!', 'Matagumpay na na-edit ang iyong produkto!', '귀하의 제품이 성공적으로 수정되었습니다!'),
(865, '', '', '_some_products_don_t_have_enough_of_units_', 'Some of your products don\'t have enough units.', 'بعض منتجاتك ليس لديها وحدات كافية.', 'Sommige van uw producten hebben niet genoeg eenheden.', 'Certains de vos produits n\'ont pas assez d\'unités.', 'Einige Ihrer Produkte haben nicht genügend Einheiten.', 'Некоторые из ваших продуктов не имеют достаточностей.', 'Algunos de sus productos no tienen suficientes unidades.', 'Ürünlerinizin bazılarının yeterli birim yok.', 'आपके कुछ उत्पादों में पर्याप्त इकाइयाँ नहीं हैं।', '您的某些产品没有足够的单位。', 'آپ کے کچھ پروڈکٹس میں کافی یونٹ نہیں ہیں۔', 'Beberapa produk Anda tidak memiliki cukup unit.', 'Neki od vaših proizvoda nemaju dovoljno jedinica.', 'לחלק מהמוצרים שלך אין מספיק יחידות.', 'আপনার কিছু পণ্যের পর্যাপ্ত ইউনিট নেই।', '一部の商品で十分な単位がありません。', 'برخی از محصولات شما واحدهای کافی ندارند.', 'Vissa av dina produkter har inte tillräckligt med enheter.', 'Một số sản phẩm của bạn không có đủ đơn vị.', 'Nogle af dine produkter har ikke nok enheder.', 'Ang ilan sa iyong mga produkto ay walang sapat na mga yunit.', '일부 제품의 단위가 충분하지 않습니다.'),
(866, '', '', '_you_don_t_have_enough_wallet_', 'You don\'t have enough balance in your wallet.', 'ليس لديك رصيد كاف في محفظتك.', 'Je hebt niet genoeg balans in je portemonnee.', 'Vous n\'avez pas assez d\'équilibre dans votre portefeuille.', 'Sie haben nicht genug Gleichgewicht in Ihrer Brieftasche.', 'У вас недостаточно баланса в вашем кошельке.', 'No tienes suficiente equilibrio en tu billetera.', 'Cüzdanında yeterince dengeniz yok.', 'आपके वॉलेट में पर्याप्त बैलेंस नहीं है।', '你的钱包里没有足够的余额。', 'آپ کے بٹوے میں کافی بیلنس نہیں ہے۔', 'Anda tidak memiliki cukup saldo di dompet Anda.', 'Nemate dovoljno sredstava u novčaniku.', 'אין לך מספיק יתרה בארנק.', 'আপনার ওয়ালেটে পর্যাপ্ত ব্যালেন্স নেই।', 'ウォレットに十分な残高がありません。', 'شما موجودی کافی در کیف پول خود ندارید.', 'Du har inte tillräckligt med saldo i plånboken.', 'Bạn không có đủ số dư trong ví của mình.', 'Du har ikke nok balance i din pung.', 'Wala kang sapat na balanse sa iyong wallet.', '지갑에 잔액이 충분하지 않습니다.'),
(867, '', '', '_please_top_up_your_wallet_', 'Please top up your wallet', 'يرجى تباريز محفظتك', 'Vul uw portemonnee bij', 'S\'il vous plaît recharger votre portefeuille', 'Bitte tippen Sie Ihre Brieftasche auf', 'Пожалуйста, пополните свой кошелек', 'Por favor, recargue su billetera', 'Lütfen cüzdanını doldur', 'कृपया अपना वॉलेट टॉप अप करें', '请充值你的钱包', 'براہ کرم اپنا بٹوہ اوپر کریں۔', 'Silakan isi dompet Anda', 'Molimo dopunite svoj novčanik', 'נא למלא את הארנק', 'অনুগ্রহ করে আপনার ওয়ালেট টপ আপ করুন', 'お財布にチャージしてください', 'لطفا کیف پول خود را شارژ کنید', 'Fyll gärna på din plånbok', 'Vui lòng nạp tiền vào ví của bạn', 'Fyld venligst din pung op', 'Mangyaring i-top up ang iyong wallet', '지갑을 충전해주세요'),
(868, '', '', '_your_order_has_been_placed_successfully_', 'Your order has been placed!', 'وقد وضعت طلبك!', 'Uw bestelling is geplaatst!', 'Votre commande a été enregistrée!', 'Deine Bestellung wurde aufgenommen!', 'Ваш заказ был размещен!', '¡Su orden ha sido puesta!', 'Siparişiniz alındı!', 'आपका आदेश दे दिया गया है!', '您的订单已下达！', 'آپ کا آرڈر بھیج دیا گیا ہے!', 'Pesanan Anda telah dilakukan!', 'Vaša narudžba je izvršena!', 'ההזמנה שלך בוצעה!', 'আপনার অর্ডার স্থাপন করা হয়েছে!', 'ご注文が確定しました！', 'سفارش شما ثبت شده است!', 'Din order har lagts!', 'Đơn hàng của bạn đã được đặt!', 'Din ordre er blevet afgivet!', 'Nailagay na ang iyong order!', '주문이 완료되었습니다!'),
(869, '', '', '_tracking_info_has_been_saved_successfully_', 'Tracking info has been saved.', 'تم حفظ معلومات التتبع.', 'Tracking-informatie is opgeslagen.', 'Les informations de suivi ont été enregistrées.', 'Tracking-Info wurde gespeichert.', 'Информация о отслеживании была сохранена.', 'La información de seguimiento se ha guardado.', 'İzleme bilgisi kaydedildi.', 'ट्रैकिंग जानकारी सहेज ली गई है।', '跟踪信息已保存。', 'ٹریکنگ کی معلومات کو محفوظ کر لیا گیا ہے۔', 'Info pelacakan telah disimpan.', 'Podaci o praćenju su spremljeni.', 'פרטי המעקב נשמרו.', 'ট্র্যাকিং তথ্য সংরক্ষণ করা হয়েছে.', '追跡情報が保存されました。', 'اطلاعات ردیابی ذخیره شده است.', 'Spårningsinformation har sparats.', 'Thông tin theo dõi đã được lưu.', 'Sporingsoplysninger er blevet gemt.', 'Nai-save na ang impormasyon sa pagsubaybay.', '추적 정보가 저장되었습니다.'),
(870, '', '', '_review_has_been_sent_successfully_', 'Review has been sent.', 'تم إرسال المراجعة.', 'Beoordeling is verzonden.', 'L\'examen a été envoyé.', 'Überprüfung wurde gesendet.', 'Обзор был отправлен.', 'Revisión ha sido enviada.', 'İnceleme gönderildi.', 'समीक्षा भेज दी गई है।', '审查已发送。', 'جائزہ بھیجا گیا ہے۔', 'Ulasan telah dikirim.', 'Pregled je poslan.', 'ביקורת נשלחה.', 'রিভিউ পাঠানো হয়েছে।', 'レビューが送信されました。', 'بررسی ارسال شد.', 'Recension har skickats.', 'Đánh giá đã được gửi.', 'Anmeldelse er sendt.', 'Naipadala na ang pagsusuri.', '리뷰가 전송되었습니다.'),
(871, '', '', '_your_request_is_under_review_', 'Your request is under review.', 'طلبك قيد المراجعة.', 'Uw aanvraag wordt beoordeeld.', 'Votre demande est à l\'étude.', 'Ihre Anfrage ist überprüft.', 'Ваш запрос находится под контролем.', 'Su solicitud está bajo revisión.', 'İsteğiniz inceleme altında.', 'आपके अनुरोध की समीक्षा की जा रही है.', '您的请求正在审核中。', 'آپ کی درخواست زیر غور ہے۔', 'Permintaan Anda sedang ditinjau.', 'Vaš zahtjev je u pregledu.', 'בקשתך נמצאת בבדיקה.', 'আপনার অনুরোধ পর্যালোচনা করা হচ্ছে.', 'あなたのリクエストは審査中です。', 'درخواست شما در حال بررسی است.', 'Din begäran granskas.', 'Yêu cầu của bạn đang được xem xét.', 'Din anmodning er under gennemgang.', 'Ang iyong kahilingan ay nasa ilalim ng pagsusuri.', '귀하의 요청을 검토 중입니다.'),
(872, '', '', '_your_story_has_been_published_successfully_', 'Your story has been published successfully!', 'تم نشر قصتك بنجاح!', 'Je verhaal is succesvol gepubliceerd!', 'Votre histoire a été publiée avec succès!', 'Ihre Geschichte wurde erfolgreich veröffentlicht!', 'Ваша история была успешно опубликована!', 'Tu historia ha sido publicada con éxito!', 'Hikayen başarılı bir şekilde yayınlandı!', 'आपकी कहानी सफलतापूर्वक प्रकाशित हो गई है!', '您的故事已成功发布！', 'آپ کی کہانی کامیابی کے ساتھ شائع ہو گئی ہے!', 'Cerita Anda telah berhasil diterbitkan!', 'Vaša priča je uspješno objavljena!', 'הסיפור שלך פורסם בהצלחה!', 'আপনার গল্প সফলভাবে প্রকাশিত হয়েছে!', 'あなたのストーリーが公開されました！', 'داستان شما با موفقیت منتشر شد!', 'Din berättelse har publicerats framgångsrikt!', 'Câu chuyện của bạn đã được xuất bản thành công!', 'Din historie er blevet offentliggjort!', 'Ang iyong kwento ay matagumpay na nai-publish!', '귀하의 이야기가 성공적으로 게시되었습니다!'),
(873, '', '', '_your_story_has_been_uploaded_successfully_to_publish_it_please_pay_', 'Your story has been uploaded, please pay to continue.', 'تم تحميل قصتك، يرجى الدفع للمتابعة.', 'Uw verhaal is geüpload, betaal alstublieft om door te gaan.', 'Votre histoire a été téléchargée, veuillez payer pour continuer.', 'Ihre Geschichte wurde hochgeladen, bitte zahlen Sie, um fortzufahren.', 'Ваша история была загружена, пожалуйста, оплатите, чтобы продолжить.', 'Su historia ha sido cargada, por favor pague para continuar.', 'Hikayen yüklendi, lütfen devam etmek için ödeme yapın.', 'आपकी कहानी अपलोड कर दी गई है, कृपया जारी रखने के लिए भुगतान करें।', '您的故事已上传，请付费继续。', 'آپ کی کہانی اپ لوڈ کر دی گئی ہے، براہ کرم جاری رکھنے کے لیے ادائیگی کریں۔', 'Cerita Anda telah diunggah, silakan bayar untuk melanjutkan.', 'Vaša priča je učitana, platite za nastavak.', 'הסיפור שלך הועלה, אנא שלם כדי להמשיך.', 'আপনার গল্প আপলোড করা হয়েছে, চালিয়ে যেতে অর্থ প্রদান করুন.', 'ストーリーがアップロードされました。続行するには料金をお支払いください。', 'داستان شما آپلود شده است، لطفا برای ادامه هزینه کنید.', 'Din berättelse har laddats upp, betala för att fortsätta.', 'Câu chuyện của bạn đã được tải lên, vui lòng trả tiền để tiếp tục.', 'Din historie er blevet uploadet, betal venligst for at fortsætte.', 'Na-upload na ang iyong kwento, mangyaring magbayad upang magpatuloy.', '귀하의 이야기가 업로드되었습니다. 계속하려면 비용을 지불하십시오.'),
(874, '', '', '_story_not_found_or_its_active_', 'Story not found or not active.', 'قصة غير موجودة أو غير نشطة.', 'Verhaal niet gevonden of niet actief.', 'Histoire non trouvée ou non active.', 'Geschichte nicht gefunden oder nicht aktiv.', 'История не найдена или не активна.', 'Historia no encontrada o no activa.', 'Hikaye bulunamadı ya da aktif değil.', 'कहानी नहीं मिली या सक्रिय नहीं है।', '故事未找到或不活跃。', 'کہانی نہیں ملی یا فعال نہیں ہے۔', 'Cerita tidak ditemukan atau tidak aktif.', 'Priča nije pronađena ili nije aktivna.', 'הסיפור לא נמצא או לא פעיל.', 'গল্প পাওয়া যায় নি বা সক্রিয় না.', 'ストーリーが見つからないか、アクティブではありません。', 'داستان یافت نشد یا فعال نیست.', 'Berättelsen hittades inte eller inte aktiv.', 'Câu chuyện không được tìm thấy hoặc không hoạt động.', 'Historien blev ikke fundet eller ikke aktiv.', 'Hindi nahanap o hindi aktibo ang kwento.', '스토리를 찾을 수 없거나 활성화되지 않았습니다.'),
(875, '', '', '_you_don_t_have_enough_money_please_top_up_your_wallet_', 'You don\'t have enough balance in your wallet, please top up your wallet.', 'ليس لديك رصيد كاف في محفظتك، يرجى تباريز محفظتك.', 'Je hebt niet genoeg balans in je portemonnee, vul je portemonnee aan.', 'Vous n\'avez pas assez d\'équilibre dans votre portefeuille, veuillez recharger votre portefeuille.', 'Sie haben nicht genug Gleichgewicht in Ihrer Brieftasche, bitte tippen Sie bitte Ihre Brieftasche auf.', 'У вас не хватает баланса в вашем кошельке, пожалуйста, пополните свой кошелек.', 'No tiene suficiente equilibrio en su billetera, por favor recargue su billetera.', 'Cüzdanınızda yeterli dengeniz yok, lütfen cüzdanınızı doldurun.', 'आपके वॉलेट में पर्याप्त बैलेंस नहीं है, कृपया अपने वॉलेट को टॉप अप करें।', '您的钱包余额不足，请为您的钱包充值。', 'آپ کے بٹوے میں کافی بیلنس نہیں ہے، براہ کرم اپنا بٹوہ ٹاپ اپ کریں۔', 'Anda tidak memiliki saldo yang cukup di dompet Anda, silakan isi ulang dompet Anda.', 'Nemate dovoljno sredstava u novčaniku, nadopunite novčanik.', 'אין לך מספיק יתרה בארנק, נא למלא את הארנק.', 'আপনার ওয়ালেটে পর্যাপ্ত ব্যালেন্স নেই, অনুগ্রহ করে আপনার ওয়ালেট টপ আপ করুন৷', 'ウォレットの残高が不足しています。ウォレットにチャージしてください。', 'شما موجودی کافی در کیف پول خود ندارید، لطفا کیف پول خود را شارژ کنید.', 'Du har inte tillräckligt med saldo i din plånbok, fyll på plånboken.', 'Bạn không có đủ số dư trong ví, vui lòng nạp tiền vào ví.', 'Du har ikke nok saldo i din pung. Fyld venligst pungen op.', 'Wala kang sapat na balanse sa iyong wallet, mangyaring i-top up ang iyong wallet.', '지갑에 잔액이 충분하지 않습니다. 지갑을 충전하세요.'),
