(1074, '', '', 'your_refund_request_has_been_approved_your_money_added_to_your_wallet', 'Your refund request has been approved, balance re-added to your wallet.', 'تمت الموافقة على طلب استرداد الأموال الخاص بك، الرصيد إعادة إضافته إلى محفظتك.', 'Uw terugbetalingsverzoek is goedgekeurd, saldo opnieuw toegevoegd aan uw portemonnee.', 'Votre demande de remboursement a été approuvée, balance re-ajoutée à votre portefeuille.', 'Ihre Erstattungsanfrage wurde genehmigt, Balance wird Ihrer Brieftasche erneut hinzugefügt.', 'Ваш запрос на возврат был одобрен, баланс повторно добавляется в ваш кошелек.', 'Su solicitud de reembolso ha sido aprobada, el saldo se ha vuelto a agregar a su billetera.', 'Geri ödeme isteğiniz onaylandı, bakiye cüzdanınıza yeniden eklendi.', 'आपका धनवापसी अनुरोध स्वीकृत हो गया है, शेष राशि आपके बटुए में पुनः जोड़ दी गई है।', '您的退款申请已获批准，余额已重新添加到您的钱包中。', 'آپ کی رقم کی واپسی کی درخواست منظور کر لی گئی ہے، بیلنس آپ کے بٹوے میں دوبارہ شامل کر دیا گیا ہے۔', 'Permintaan pengembalian dana Anda telah disetujui, saldo ditambahkan kembali ke dompet Anda.', 'Vaš zahtjev za povrat je odobren, saldo je ponovno dodan u vaš novčanik.', 'בקשת ההחזר שלך אושרה, היתרה נוספה מחדש לארנק שלך.', 'আপনার রিফান্ডের অনুরোধ অনুমোদিত হয়েছে, ব্যালেন্স আবার আপনার ওয়ালেটে যোগ করা হয়েছে।', '払い戻しリクエストが承認され、残高がウォレットに再追加されました。', 'درخواست بازپرداخت شما تأیید شد، موجودی مجدداً به کیف پول شما اضافه شد.', 'Din begäran om återbetalning har godkänts, saldot har lagts till i din plånbok igen.', 'Yêu cầu hoàn tiền của bạn đã được chấp thuận, số dư được thêm vào ví của bạn.', 'Din anmodning om tilbagebetaling er blevet godkendt, saldoen er tilføjet til din tegnebog igen.', 'Naaprubahan ang iyong kahilingan sa refund, muling idinagdag ang balanse sa iyong wallet.', '환불 요청이 승인되었으며 잔액이 지갑에 다시 추가되었습니다.'),
