(1078, '', '', 'bought_a_ticket', 'bought a ticket, you got a new sale!', 'اشترى تذكرة، حصلت على بيع جديد!', 'Kocht een ticket, je hebt een nieuwe verkoop!', 'acheté un billet, vous avez une nouvelle vente!', 'Kaufte ein Ticket, du hast einen neuen Verkauf!', 'Купил билет, у вас есть новая распродажа!', '¡Compró un boleto, tienes una nueva venta!', 'Bir bilet aldım, yeni bir satışın var!', 'एक टिकट खरीदा, आपको एक नई बिक्री मिली!', '买了一张票，你有一个新的销售！', 'ایک ٹکٹ خریدا، آپ کو ایک نئی فروخت مل گئی!', 'membeli tiket, Anda mendapat penjualan baru!', 'kupio kartu, dobio si novu akciju!', 'קנית כרטיס, קיבלת מבצע חדש!', 'একটি টিকিট কিনেছেন, আপনি একটি নতুন বিক্রয় পেয়েছেন!', 'チケットを購入すると、新しいセールが始まりました!', 'بلیت خریدی، فروش جدیدی گرفتی!', 'köpte en biljett, du fick en ny rea!', 'đã mua một vé, bạn có một đợt giảm giá mới!', 'købte en billet, fik du et nyt salg!', 'bumili ka ng ticket, may bagong benta ka!', '티켓을 구입하고 새로운 판매를 얻었습니다!'),
