(1081, '', '', 'order_not_found', 'Order not found', 'غير موجود', 'Bestellen niet gevonden', 'Commande introuvable', 'Bestellen nicht gefunden', 'Не найден', 'Orden no encontrado', 'Sipariş bulunamadı', 'आदेश नहीं मिला', '未找到订单', 'آرڈر نہیں ملا', 'Pesanan tidak ditemukan', 'Narudžba nije pronađena', 'ההזמנה לא נמצאה', 'অর্ডার পাওয়া যায়নি', '注文が見つかりません', 'سفارش پیدا نشد', 'Beställningen hittades inte', 'Không tìm thấy đơn hàng', 'Ordren blev ikke fundet', 'Hindi nakita ang order', '주문을 찾을 수 없음'),
(1082, '', '', 'if_the_order_status_wasn_t_set_to_delivered_within_60_days_from_the_order_date__it_will_be_automatically_be_sent_to__delivered_.', 'If the order status wasn\'t set to delivered within 60 days from the order date, it will be automatically be set to Delivered.', 'إذا لم يتم تعيين حالة الطلب لتسليمها في غضون 60 يوما من تاريخ الطلب، فسيتم تعيينه تلقائيا لتسليمه.', 'Als de bestelstatus niet is ingesteld op afgeleverd binnen 60 dagen na de besteldatum, wordt deze automatisch ingesteld op afgeleverd.', 'Si l\'état de la commande n\'était pas défini sur livré dans les 60 jours à compter de la date de la commande, il sera automatiquement défini sur livré.', 'Wenn der Bestellstatus nicht innerhalb von 60 Tagen ab dem Bestelldatum angeliefert wurde, wird es automatisch aufgeliefert.', 'Если статус заказа не был установлен для доставки в течение 60 дней с даты заказа, он будет автоматически установлен для доставки.', 'Si el estado del pedido no se configuró para entregar dentro de 60 días a partir de la fecha del pedido, se establecerá automáticamente en entregarse.', 'Sipariş durumu, sipariş tarihinden itibaren 60 gün içinde teslim edilmemişse, otomatik olarak teslim edilecek şekilde ayarlanacaktır.', 'यदि ऑर्डर की स्थिति ऑर्डर की तारीख से 60 दिनों के भीतर डिलीवर करने के लिए सेट नहीं की गई थी, तो यह स्वचालित रूप से डिलीवर पर सेट हो जाएगी।', '如果订单状态未在订单日期后 60 天内设置为已发货，则会自动设置为已发货。', 'اگر آرڈر کی حیثیت کو آرڈر کی تاریخ سے 60 دنوں کے اندر ڈیلیور کرنے کے لیے سیٹ نہیں کیا گیا تھا، تو یہ خود بخود ڈیلیور پر سیٹ ہو جائے گا۔', 'Jika status pesanan tidak disetel ke terkirim dalam waktu 60 hari sejak tanggal pemesanan, status akan secara otomatis disetel ke Terkirim.', 'Ako status narudžbe nije postavljen na Isporučeno unutar 60 dana od datuma narudžbe, automatski će biti postavljen na Isporučeno.', 'אם סטטוס ההזמנה לא הוגדר למסירה תוך 60 יום מתאריך ההזמנה, הוא יוגדר אוטומטית למסירה.', 'যদি অর্ডারের স্ট্যাটাস অর্ডারের তারিখ থেকে 60 দিনের মধ্যে ডেলিভারির জন্য সেট করা না থাকে, তাহলে এটি স্বয়ংক্রিয়ভাবে ডেলিভারে সেট হয়ে যাবে।', '注文日から60日以内に注文ステータスが配達済みに設定されなかった場合、自動的に配達済みに設定されます。', 'اگر وضعیت سفارش برای تحویل ظرف 60 روز از تاریخ سفارش تنظیم نشده باشد، به طور خودکار روی تحویل داده می شود.', 'Om beställningsstatusen inte var inställd på levererad inom 60 dagar från beställningsdatumet kommer den automatiskt att ställas in på Levererat.', 'Nếu trạng thái đơn hàng không được đặt thành đã giao trong vòng 60 ngày kể từ ngày đặt hàng, trạng thái đó sẽ tự động được đặt thành Đã giao.', 'Hvis ordrestatus ikke er angivet til leveret inden for 60 dage fra ordredatoen, vil den automatisk blive indstillet til Leveret.', 'Kung ang katayuan ng order ay hindi itinakda upang maihatid sa loob ng 60 araw mula sa petsa ng order, awtomatiko itong itatakda sa Naihatid.', '주문일로부터 60일 이내에 주문 상태가 배송됨으로 설정되지 않은 경우 자동으로 배송됨으로 설정됩니다.'),
(1083, '', '', 'if_the_order_wasn_t_actually_delivered__the_buyer_can_request_a_refund.', 'If the order wasnt actually delivered, the buyer can request a refund.', 'إذا لم يتم تسليم الطلب بالفعل، يمكن للمشتري طلب استرداد.', 'Als de bestelling niet daadwerkelijk is afgeleverd, kan de koper een terugbetaling aanvragen.', 'Si la commande n\'a pas été réellement livrée, l\'acheteur peut demander un remboursement.', 'Wenn die Bestellung nicht tatsächlich geliefert wurde, kann der Käufer eine Rückerstattung anfordern.', 'Если заказ на самом деле не был доставлен, покупатель может запросить возмещение.', 'Si el pedido no se entregó en realidad, el comprador puede solicitar un reembolso.', 'Sipariş aslında teslim edilmediyse, alıcı bir geri ödeme talebinde bulunabilir.', 'यदि आदेश वास्तव में वितरित नहीं किया गया था, तो खरीदार धनवापसी का अनुरोध कर सकता है।', '如果订单没有实际交付，买家可以要求退款。', 'اگر آرڈر اصل میں ڈیلیور نہیں ہوا تو خریدار رقم کی واپسی کی درخواست کر سکتا ہے۔', 'Jika pesanan tidak benar-benar terkirim, pembeli dapat meminta pengembalian dana.', 'Ako narudžba nije stvarno isporučena, kupac može zatražiti povrat novca.', 'אם ההזמנה לא נמסרה בפועל, הקונה יכול לבקש החזר כספי.', 'অর্ডার আসলে ডেলিভারি করা না হলে, ক্রেতা একটি ফেরত অনুরোধ করতে পারেন.', '注文が実際に配達されなかった場合、購入者は返金を要求できます。', 'اگر سفارش واقعاً تحویل داده نشده باشد، خریدار می تواند درخواست بازپرداخت کند.', 'Om beställningen inte faktiskt levererades kan köparen begära återbetalning.', 'Nếu đơn đặt hàng không thực sự được giao, người mua có thể yêu cầu hoàn lại tiền.', 'Hvis ordren faktisk ikke blev leveret, kan køberen anmode om en refusion.', 'Kung hindi talaga naihatid ang order, maaaring humiling ng refund ang mamimili.', '주문이 실제로 배송되지 않은 경우 구매자는 환불을 요청할 수 있습니다.'),
