(1091, '', '', 'please_wait__this_may_take_few_minutes.', 'Please wait, this may take few minutes.', 'يرجى الانتظار، قد يستغرق هذا بضع دقائق.', 'Even geduld, dit kan enkele minuten duren.', 'Veuillez patienter, cela peut prendre quelques minutes.', 'Bitte warten, dies kann nur wenige Minuten dauern.', 'Пожалуйста, подождите, это может занять несколько минут.', 'Por favor, espere, esto puede tardar unos minutos.', 'Lütfen bekleyin, bu birkaç dakika sürebilir.', 'कृपया प्रतीक्षा करें, इसमें कुछ मिनट लग सकते हैं।', '请稍候，这可能需要几分钟。', 'براہ کرم انتظار کریں، اس میں کچھ منٹ لگ سکتے ہیں۔', 'Harap tunggu, ini mungkin memakan waktu beberapa menit.', 'Molimo pričekajte, ovo može potrajati nekoliko minuta.', 'אנא המתן, זה עשוי להימשך מספר דקות.', 'অনুগ্রহ করে অপেক্ষা করুন, এতে কয়েক মিনিট সময় লাগতে পারে।', 'お待ちください。これには数分かかる場合があります。', 'لطفا صبر کنید، ممکن است چند دقیقه طول بکشد.', 'Vänta, detta kan ta några minuter.', 'Vui lòng đợi, quá trình này có thể mất vài phút.', 'Vent venligst, dette kan tage et par minutter.', 'Mangyaring maghintay, maaaring tumagal ito ng ilang minuto.', '잠시만 기다려 주세요. 몇 분 정도 걸릴 수 있습니다.'),
(1092, '', '', 'instead_of_uploading_a_song__you_can_easily_import_songs_using', 'Instead of uploading a song, you can easily import songs using', 'بدلا من تحميل أغنية، يمكنك بسهولة استيراد الأغاني باستخدام', 'In plaats van een nummer te uploaden, kunt u eenvoudig nummers importeren met', 'Au lieu de télécharger une chanson, vous pouvez facilement importer des chansons en utilisant', 'Anstatt ein Lied hochzuladen, können Sie Songs problemlos importieren', 'Вместо того, чтобы загрузить песню, вы можете легко импортировать песни, используя', 'En lugar de cargar una canción, puede importar fácilmente las canciones usando', 'Bir şarkı yüklemek yerine, kullanarak kolayca şarkı içe aktarabilirsiniz.', 'एक गाना अपलोड करने के बजाय, आप आसानी से गाने का उपयोग करके आयात कर सकते हैं', '无需上传歌曲，您可以使用轻松导入歌曲', 'گانا اپ لوڈ کرنے کے بجائے، آپ آسانی سے گانا استعمال کر کے امپورٹ کر سکتے ہیں۔', 'Alih-alih mengunggah lagu, Anda dapat dengan mudah mengimpor lagu menggunakan', 'Umjesto učitavanja pjesme, možete jednostavno uvesti pjesme pomoću', 'במקום להעלות שיר, אתה יכול בקלות לייבא שירים באמצעות', 'একটি গান আপলোড করার পরিবর্তে, আপনি সহজেই ব্যবহার করে গান আমদানি করতে পারেন', '曲をアップロードする代わりに、次を使用して簡単に曲をインポートできます', 'به جای آپلود آهنگ، می توانید به راحتی آهنگ ها را با استفاده از آن وارد کنید', 'Istället för att ladda upp en låt kan du enkelt importera låtar med hjälp av', 'Thay vì tải lên một bài hát, bạn có thể dễ dàng nhập các bài hát bằng cách sử dụng', 'I stedet for at uploade en sang, kan du nemt importere sange vha', 'Sa halip na mag-upload ng kanta, madali kang makakapag-import ng mga kanta gamit ang', '노래를 업로드하는 대신 다음을 사용하여 노래를 쉽게 가져올 수 있습니다.'),
