(1196, '', '', 'upload_a_new_song_alert', 'At least one uploaded song is required to post a product, you can {LINK}.', 'يلزم تحميل أغنية واحدة على الأقل لنشر منتج ، يمكنك {LINK}.', 'Er is ten minste één geüpload nummer vereist om een product te plaatsen, je kunt {LINK}.', 'Au moins une chanson téléchargée est requise pour publier un produit, vous pouvez {LINK}.', 'Mindestens ein hochgeladener Song ist erforderlich, um ein Produkt zu posten, Sie können {LINK}.', 'Для публикации продукта требуется хотя бы одна загруженная песня, вы можете {LINK}.', 'Se requiere al menos una canción cargada para publicar un producto, puedes {ENLACE}.', 'Bir ürünü yayınlamak için en az bir yüklenmiş şarkı gerekir, {LINK} yapabilirsiniz.', 'किसी उत्पाद को पोस्ट करने के लिए कम से कम एक अपलोड किया गया गीत आवश्यक है, आप {LINK} कर सकते हैं।', '至少需要一首上传的歌曲才能发布产品，您可以{LINK}。', 'پروڈکٹ پوسٹ کرنے کے لیے کم از کم ایک اپ لوڈ کردہ گانا درکار ہے، آپ {LINK} کرسکتے ہیں۔', 'Setidaknya satu lagu yang diunggah diperlukan untuk memposting produk, Anda dapat {LINK}.', 'Za objavu proizvoda potrebna je barem jedna prenesena pjesma, možete {LINK}.', 'נדרש לפחות שיר אחד שהועלה כדי לפרסם מוצר, אתה יכול {LINK}.', 'একটি পণ্য পোস্ট করার জন্য কমপক্ষে একটি আপলোড করা গান প্রয়োজন, আপনি {LINK} করতে পারেন৷', '商品を投稿するには、少なくとも 1 つのアップロードされた曲が必要です。{LINK} できます。', 'حداقل یک آهنگ آپلود شده برای پست یک محصول مورد نیاز است، می توانید {LINK}.', 'Minst en uppladdad låt krävs för att lägga upp en produkt, du kan {LINK}.', 'Bạn phải có ít nhất một bài hát đã tải lên để đăng sản phẩm, bạn có thể {LINK}.', 'Der kræves mindst én uploadet sang for at sende et produkt. Du kan {LINK}.', 'Hindi bababa sa isang na-upload na kanta ang kinakailangan upang mag-post ng produkto, maaari mong {LINK}.', '제품을 게시하려면 업로드된 노래가 하나 이상 필요합니다. {LINK}할 수 있습니다.'),
