(1233, '', '', 'after_artist', 'You can use those features once your account being artist.', 'يمكنك استخدام هذه الميزات بمجرد أن يصبح حسابك فنانًا.', 'U kunt deze functies gebruiken zodra uw account artiest is.', 'Vous pouvez utiliser ces fonctionnalités une fois que votre compte est artiste.', 'Sie können diese Funktionen nutzen, sobald Ihr Konto Künstler ist.', 'Вы можете использовать эти функции, как только ваша учетная запись станет артистом.', 'Puede usar esas funciones una vez que su cuenta sea artista.', 'Hesabınız sanatçı olduktan sonra bu özellikleri kullanabilirsiniz.', 'आपका खाता कलाकार होने के बाद आप उन सुविधाओं का उपयोग कर सकते हैं।', '一旦您的帐户成为艺术家，您就可以使用这些功能。', 'آپ کا اکاؤنٹ آرٹسٹ ہونے کے بعد آپ ان خصوصیات کو استعمال کر سکتے ہیں۔', 'Anda dapat menggunakan fitur tersebut setelah akun Anda menjadi artis.', 'Te značajke možete koristiti nakon što vaš račun postane umjetnik.', 'אתה יכול להשתמש בתכונות האלה ברגע שחשבונך הוא אמן.', 'আপনার অ্যাকাউন্ট শিল্পী হওয়ার পরে আপনি সেই বৈশিষ্ট্যগুলি ব্যবহার করতে পারেন।', 'アカウントがアーティストになると、これらの機能を使用できます。', 'وقتی حساب شما هنرمند شد، می‌توانید از این ویژگی‌ها استفاده کنید.', 'Du kan använda dessa funktioner när ditt konto är artist.', 'Bạn có thể sử dụng các tính năng đó khi tài khoản của bạn là nghệ sĩ.', 'Du kan bruge disse funktioner, når din konto er kunstner.', 'Magagamit mo ang mga feature na iyon kapag naging artist na ang iyong account.', '계정이 아티스트가 되면 이러한 기능을 사용할 수 있습니다.'),
