(1321, '', '', 'create_playlist_desc', 'Create playlist and listing music anywhere', 'إنشاء قائمة تشغيل وإدراج الموسيقى في أي مكان', 'Maak een afspeellijst en vermeld overal muziek', 'Créez une liste de lecture et répertoriez de la musique n&#39;importe où', 'Erstellen Sie Wiedergabelisten und listen Sie Musik überall auf', 'Создавайте плейлисты и размещайте музыку в любом месте', 'Crea listas de reproducción y lista de música en cualquier lugar', 'Çalma listesi oluşturun ve her yerde müzik listeleyin', 'कहीं भी प्लेलिस्ट और लिस्टिंग संगीत बनाएं', '随时随地创建播放列表和列表音乐', 'کہیں بھی پلے لسٹ اور لسٹنگ میوزک بنائیں', 'Buat daftar putar dan cantumkan musik di mana saja', 'Napravite popis za reprodukciju i navedite glazbu bilo gdje', 'צור רשימת השמעה ורישום מוזיקה בכל מקום', 'প্লেলিস্ট তৈরি করুন এবং যে কোনো জায়গায় সঙ্গীত তালিকাভুক্ত করুন', 'どこでもプレイリストとリスト音楽を作成', 'لیست پخش ایجاد کنید و موسیقی را در هر جایی فهرست کنید', 'Skapa spellista och notera musik var som helst', 'Tạo danh sách phát và liệt kê nhạc ở mọi nơi', 'Opret afspilningsliste og noter musik hvor som helst', 'Gumawa ng playlist at maglista ng musika kahit saan', '어디서나 재생 목록 및 목록 음악 만들기'),
(1322, '', '', 'track_process_wait', 'This track is still being processed, you can come back later and check again.', 'لا يزال هذا المسار قيد المعالجة ، يمكنك العودة لاحقًا والتحقق مرة أخرى.', 'Deze track wordt nog verwerkt, je kunt later terugkomen en het opnieuw controleren.', 'Cette piste est toujours en cours de traitement, vous pouvez revenir plus tard et vérifier à nouveau.', 'Dieser Titel wird noch verarbeitet, Sie können später wiederkommen und es erneut überprüfen.', 'Этот трек все еще обрабатывается, вы можете вернуться позже и проверить еще раз.', 'Esta pista aún se está procesando, puede volver más tarde y verificar nuevamente.', 'Bu parça hala işleniyor, daha sonra gelip tekrar kontrol edebilirsiniz.', 'यह ट्रैक अभी भी संसाधित किया जा रहा है, आप बाद में वापस आ सकते हैं और दोबारा जांच कर सकते हैं।', '此曲目仍在处理中，您可以稍后再回来查看。', 'اس ٹریک پر ابھی بھی کارروائی ہو رہی ہے، آپ بعد میں واپس آ کر دوبارہ چیک کر سکتے ہیں۔', 'Lagu ini masih diproses, Anda dapat kembali lagi nanti dan memeriksanya lagi.', 'Ova pjesma se još uvijek obrađuje, možete se vratiti kasnije i provjeriti ponovno.', 'המסלול הזה עדיין בעיבוד, אתה יכול לחזור מאוחר יותר ולבדוק שוב.', 'এই ট্র্যাকটি এখনও প্রক্রিয়া করা হচ্ছে, আপনি পরে ফিরে এসে আবার চেক করতে পারেন৷', 'このトラックはまだ処理中です。後で戻ってもう一度確認してください。', 'این آهنگ هنوز در حال پردازش است، می‌توانید بعداً بازگردید و دوباره بررسی کنید.', 'Det här spåret bearbetas fortfarande, du kan komma tillbaka senare och kolla igen.', 'Bản nhạc này vẫn đang được xử lý, bạn có thể quay lại sau và kiểm tra lại.', 'Dette spor behandles stadig, du kan vende tilbage senere og tjekke igen.', 'Pinoproseso pa rin ang track na ito, maaari kang bumalik sa ibang pagkakataon at suriin muli.', '이 트랙은 아직 처리 중입니다. 나중에 다시 돌아와서 확인할 수 있습니다.'),
